CREATE DEFINER=`root`@`localhost` PROCEDURE `consultarCatalog` (IN `tip` VARCHAR(32))  NO SQL
BEGIN
	IF tip = 'carreras' THEN
    	SELECT carreras.idCarrera as `Cve-Carrera`, carreras.carrera as Carrera FROM carreras WHERE 1;
    END IF;
    IF tip = 'grupos' THEN
SELECT gru.idGrupo, gru.nombreGrupo, gru.salon, gru.hora, gru.idPeriodo, carr.carrera, prof.nombre, prof.apellidoP, prof.apellidoM, prof.rfc  FROM grupos as gru LEFT JOIN profesores as prof ON gru.rfcTutor = prof.rfc INNER JOIN carreras as carr ON gru.idCarrera = carr.idCarrera;
    END IF;
    IF tip = 'tutores' THEN
SELECT profesores.rfc, profesores.nombre, profesores.apellidoP, profesores.apellidoM, profesores.activo, profesores.email, carreras.carrera FROM profesores INNER JOIN roles ON profesores.rfc = roles.rfc INNER JOIN carreras ON roles.idCarrera = carreras.idCarrera WHERE roles.rol = 'Tutor';
    END IF;
    IF tip = 'coordinadores' THEN
SELECT profesores.rfc, profesores.nombre, profesores.apellidoP, profesores.apellidoM, profesores.activo, profesores.email, carreras.carrera FROM profesores INNER JOIN roles ON profesores.rfc = roles.rfc INNER JOIN carreras ON roles.idCarrera = carreras.idCarrera WHERE roles.rol = 'Coordinador';
    END IF;
    IF tip = 'archivos' THEN
SELECT documentos.archivo, documentos.fecha, documentos.id FROM documentos ORDER BY documentos.fecha;
    END IF;
    IF tip = 'avisos' THEN
SELECT * FROM avisos ORDER BY avisos.fecha;
    END IF;
      IF tip = 'avisos-tutor' THEN
SELECT * FROM avisos WHERE avisos.aquien LIKE '%Tutor,%' ORDER BY avisos.fecha DESC;
    END IF;
END$$

