INSERT INTO `avisos` (`idAviso`, `aviso`, `aquien`, `fecha`, `dirigido`, `dequien`) VALUES
(41, 'Hola tutores/as, los anexos ya pueden ser realizados por los alumnos. Además en el menú de Tutores: Consultas > Encuestas. Pueden ver sus grupos y quienes han realizado las encuestas. \r\nGracias, cualquier duda o problema técnico comunicar con la profesora Zulma lo más pronto posible.', ',Tutor,', '2016-10-24', 'Todos', 'admin'),
(42, 'Hola alumnos/as, el comunicado a razón de que realicen todos los anexos que se encuentran en el menú Tutorados: Anexos. Cualquier duda o problema, comunicarlo con su tutor/a lo más pronto posible. Gracias.', 'Tutorado,,', '2016-10-24', 'Todos', 'admin'),
(43, 'Buen día chicos,\r\n\r\nSolamente para recordarles que quedo a su disposición ya que sigo como su tutor durante el resto de la carrera.\r\n\r\nLes pido que cualquier situación la traten a través de este medio.\r\n\r\nGracias.', 'Tutorado,,', '2017-02-02', 'ISIC-2016-3-A', 'CUJM870208A66'),
(44, 'Chicos buen día.\r\n\r\nYa tengo sus créditos complementarios. Les pido que pasen a recogerlos en el dificio C, planta baja (Coordinación de Lenguas Extranjeras) de lunes a viernes de 10 am a 11 am, de 12 pm a 1 pm o bien de 4 pm a 6 pm.\r\n\r\nLos espero.\r\n\r\nGracias.', 'Tutorado,,', '2017-02-16', 'ISIC-2016-3-A', 'CUJM870208A66'),
(45, 'Probando sistema', ',Tutor,', '2017-02-19', 'Todos', 'admin');
