(1, 2, 14120566, '[{\"name\":\"rel-herm1\",\"value\":\"ROGELIO\"},{\"name\":\"act-herm1\",\"value\":\"SOMOS BUENOS HERMANOS, QUIZÁ NO NOS CONTAMOS TODO, TENEMOS DIFERENCIAS Y DISCUSIONES POR CUESTIÓN DE LIMPIEZA DE LA CASA, PERO DE AHI EN ADELANTE NOS LLEVAMOS MUY BIEN, NO VIVIRÍAMOS UNO SIN EL OTRO\"},{\"name\":\"rel-herm2\",\"value\":\"DANI\"},{\"name\":\"act-herm2\",\"value\":\"CHOCAMOS MUCHO EN CUESTIÓN DE CARÁCTER, PERO SIEMPRE TRATO DE CONTROLARME YO, ELLA TIENE UN SINDROME, Y POR LAS HORMONAS QUE TOMABA SE ALTERABA MUCHO, Y TRATO DE LLEVARNOS BIEN\"},{\"name\":\"rel-herm3\",\"value\":\"EDUARDO\"},{\"name\":\"act-herm3\",\"value\":\"ES EL PEQUEÑO, LO QUIERO MUCHO IGUAL QUE A MIS OTROS HERMANOS, ES UN NIÑO MUY TIERNO, ME LLEVO MUY BIEN CON ÉL, CUANDO NADIE QUIERE HABLAR CONMIGO, ÉL ME ESCUCHA Y ES BUENO CONMIGO SIEMPRE\"},{\"name\":\"lig-afe\",\"value\":\"PADRE\"},{\"name\":\"lig-por\",\"value\":\"AUNQUE MI MAMÁ ES LA QUE ME ESCUCHA MÁS, ME SIENTO MAS INDENTIFICADA CON ÉL, PENSAMOS MUCHAS COSAS EN COMÚN, Y NO ME CUESTIONA TANTO\"},{\"name\":\"ocu-dir\",\"value\":\"MADRE\"},{\"name\":\"inf-dir\",\"value\":\"MADRE\"},{\"name\":\"dat-fam\",\"value\":\"NO, CREO QUE A PESAR DE TODO, Y DE QUE MIS PADRES DESDE MUY TEMPRANA EDAD NOS DEJARON PARA ELLOS TRABAJAR, NUNCA NOS DESCUIDARON, ELPOCO TIEMPO QUE NOS DABAN ES DE CALIDAD, LOS FINES DE SEMANA SON DE ESTAR JUNTOS, ES COMO UNA TRADICIÓN, ME GUSTA\"},{\"name\":\"rel-com\",\"value\":\"Buena\"},{\"name\":\"rel-por\",\"value\":\"NO COINCIDO EN  MUCHAS MANERAS DE PENSAR CON ELLOS, Y HAY PENSAMIENTOS DE ELLOS QUE SIMPLEMENTE VAN EN CONTRA DE MIS IDEALES, POR ESO PREFIERO ALEJARME \"},{\"name\":\"rel-ami\",\"value\":\"SOLO PLATICAMOS Y ASI EN LA ESCUELA, AFUERA NO, AL MENOS CON UNO QUE OTRO COMPAÑERO\"},{\"name\":\"rel-pro\",\"value\":\"NORMAL, NO ME LLEVO MAL CON NINGUNO, TRATO DE PASAR ESA LINEA DE ALUMNO-MESTRO\"},{\"name\":\"rel-aca\",\"value\":\"NORMAL, NO ESTOY MUY RELACIONADA CON ELLOS\"},{\"name\":\"tie-lib\",\"value