(1, 2, 16121025, '[{\"name\":\"rel-herm1\",\"value\":\"Con mi hermana existe una relación de cariño y confianza.\"},{\"name\":\"act-herm1\",\"value\":\"Hacia ella tengo una actitud de respeto y admiración\"},{\"name\":\"lig-afe\",\"value\":\"Mi Madre\"},{\"name\":\"lig-por\",\"value\":\"Siempre con mi madre el cariño ha sido más explicito que con cualquier otro de mis familiares\"},{\"name\":\"ocu-dir\",\"value\":\"Mi padre\"},{\"name\":\"inf-dir\",\"value\":\"Fuera de que sea una obligación suya, mi padre siempre se ha interaso en mi educación para que en un futuro tenga mejores oportunidades de tener una calidad de vida mejor\"},{\"name\":\"dat-fam\",\"value\":\"Ninguno\"},{\"name\":\"rel-com\",\"value\":\"Buena\"},{\"name\":\"rel-por\",\"value\":\"Nos relacionamos muy bien, tenemos gustos y pasiones en común, por lo que tenemos una convivencia muy agradable y sana.\"},{\"name\":\"rel-ami\",\"value\":\"Excelente. Bien dicen que los amigos son la familia que uno escoje. Siempre hemos estado ahi apoyandonos cuando alguno más lo necesita.\"},{\"name\":\"rel-pro\",\"value\":\"Muy buena. Son excelentes personas y profesionistas. Sin duda una gran guia para nuestro camino durante la carrera unversitaria.\"},{\"name\":\"rel-aca\",\"value\":\"No hay alguna relación directa, pero como a toda autoridad, se le merece respeto.\"},{\"name\":\"tie-lib\",\"value\":\"Me gusta leer, escucar música, salir a caminar, de paseo con mis ammigos o familia.\"},{\"name\":\"act-rec\",\"value\":\"Leer y salir a caminar.\"},{\"name\":\"puntual\",\"value\":\"Frecuente\"},{\"name\":\"pun-obs\",\"value\":\"Ninguna\"},{\"name\":\"timido\",\"value\":\"Poco\"},{\"name\":\"tim-obs\",\"value\":\"Ninguna\"},{\"name\":\"alegre\",\"value\":\"Frecuente\"},{\"name\":\"ale-obs\",\"value\":\"Ninguna\"},{\"name\":\"agresivo\",\"value\":\"Poco\"},{\"name\":\"agr-obs\",\"value\":\"Ninguna\"},{\"name\":\"ideas\",\"value\":\"Mucho\"},{\"name\":\"ide-obs\",\"value\":\"Ninguna\"},{\"name\":\"reflexivo\",\"value\":\"Frecuente\"},{\"name\":\"rel-obs\",\"value\":\"Ninguna\"},{\"name\":\"constante\",\"value\":\"Mucho\"},{\"name\":\"con-obs\",\"value\":\"Ninguna\"},{\"name\":\"optimista\",\"value\":\"Mucho\"},{\"name\":\"opt-obs\",\"value\":\"Ninguna\"},{\"name\":\"constante\",\"value\":\"Poco\"},{\"name\":\"imp-obs\",\"value\":\"Ninguna\"},{\"name\":\"silencioso\",\"value\":\"Poco\"},{\"name\":\"sil-obs\",\"value\":\"Ninguna\"},{\"name\":\"generoso\",\"value\":\"Frecuente\"},{\"name\":\"gen-obs\",\"value\":\"Ninguna\"},{\"name\":\"inquieto\",\"value\":\"Poco\"},{\"name\":\"inq-obs\",\"value\":\"Ninguna\"},{\"name\":\"humor\",\"value\":\"No\"},{\"name\":\"cam-obs\",\"value\":\"Ninguna\"},{\"name\":\"dominante\",\"value\":\"No\"},{\"name\":\"dom-obs\",\"value\":\"Ninguna\"},{\"name\":\"egoista\",\"value\":\"No\"},{\"name\":\"ego-obs\",\"value\":\"Ninguna\"},{\"name\":\"sumiso\",\"value\":\"No\"},{\"name\":\"sum-obs\",\"value\":\"Ninguna\"},{\"name\":\"confiado\",\"value\":\"Frecuente\"},{\"name\":\"confi-obs\",\"value\":\"Ninguna\"},{\"name\":\"imaginativo\",\"value\":\"Frecuente\"},{\"name\":\"imag-obs\",\"value\":\"Ninguna\"},{\"name\":\"iniciativa\",\"value\":\"Frecuente\"},{\"name\":\"ini-obs\",\"value\":\"Ninguna\"},{\"name\":\"sociable\",\"value\":\"Frecuente\"},{\"name\":\"soc-obs\",\"value\":\"Ninguna\"},{\"name\":\"responsable\",\"value\":\"Frecuente\"},{\"name\":\"resp-obs\",\"value\":\"Ninguna\"},{\"name\":\"perseverante\",\"value\":\"Mucho\"},{\"name\":\"per-obs\",\"value\":\"Ninguna\"},{\"name\":\"motivado\",\"value\":\"Mucho\"},{\"name\":\"mot-obs\",\"value\":\"Ninguna\"},{\"name\":\"activo\",\"value\":\"Frecuente\"},{\"name\":\"act-obs\",\"value\":\"Ninguna\"},{\"name\":\"independiente\",\"value\":\"Mucho\"},{\"name\":\"ind-obs\",\"value\":\"Ninguna\"},{\"name\":\"com-ser\",\"value\":\"Ademas de ser Ingeniero, me gustaría ser una mejor persona, humilde, tabajador, dispuesto a ayudar a la gente.\"},{\"name\":\"ayu-esc\",\"value\":\"De vez en cuando\"},{\"name\":\"pro-est\",\"value\":\"Ninguno\"},{\"name\":\"ren-esc\",\"value\":\"Termino medio. Ni muy ni muy bajo\"},{\"name\":\"asi-act\",\"value\":\"Fundamentos de programación. Matemáticas discretas. Cálculo Diferencial. Taller de Ética. Fundamentos de Investigación. Taller de Administración.\"},{\"name\":\"asi-pre\",\"value\":\"Fundamentos de programación. Desde temprana edad sentí gran interés por el mundo de la infomatica. Ademas de que esta materia es la base para seguir avanzando en la carrera.\"},{\"name\":\"asi-sob\",\"value\":\"Matemáticas discretas. Quizá no sobresalga mucho, pero es una materia muy interresante y se me da bien. Esta materia me ayuda a comprender mejor el funcionamiento de un sistema informático.\"},{\"name\":\"asi-des\",\"value\":\"Taller de Administración. Porque todos esos conceptos y terminos empresariales, económicos y demás, nunca me han gustado. Sé que es una materia muy importante, pero definitivamente ese no es mi campo.\"},{\"name\":\"baj-pro\",\"value\":\"Cálculo. Porque no he rendido al ciento por ciento en esa materia. Se me dificulta un poco y es por ello que es la materia con calificaiones más bajas que he obtenido.\"},{\"name\":\"vie-tec\",\"value\":\"Porque es una institución educativa de nivel superior con una buena reputación y excelentes planes de estudio. Se destaca de los mejores Tecnológicos del país.\"},{\"name\":\"mot-tec\",\"value\":\"Me motiva el llegar a superarme y obtener la herramientas y conocimientos que me ayuden a tener una mejor clidad de vida para mí y mi familia\"},{\"name\":\"pro-ant\",\"value\":\"9.3, durante la prepa.\"},{\"name\":\"asi-repr\",\"value\":\"No.\"},{\"name\":\"pla-inm\",\"value\":\"Seguir estudiando y preparandome.\"},{\"name\":\"met-vid\",\"value\":\"Llegar a ser un Ingeniero en Sistemas Computacionales, tener un buen trabajo, y tener una mejor calidad de vida para mí y mi fmilia.\"},{\"name\":\"nom-ent\",\"value\":\"José Manuel Cuin Jacuinde\"},{\"name\":\"yo-soy\",\"value\":\"Ignacio Díaz Madrigal, estudiante de Ingenería en Sistemas computaconales\"},{\"name\":\"car-es\",\"value\":\"A veces un poco fuerte, pero siempre soy alegre, amistoso accesible con la gente\"},{\"name\":\"gus-que\",\"value\":\"Me gusta que mis metas se cumplan tal y como me las propuse. Me gusta que las personas sean sinceras conmigo, que me escuchen y escucharlas.\"},{\"name\":\"asp-vid\",\"value\":\"A ser un profesionista, pero sobre todo una mejor persona, una persona de provecho.\"},{\"name\":\"mie-que\",\"value\":\"Mis seres queridos me llegaran a faltar y que no estén ahí para verme lograr todas mis metas\"},{\"name\":\"que-log\",\"value\":\"Podré lograr todas la metas que me proponga, siempre y cuando ponga mi entusiamo, todo mi esfuerzo, todo de mí. Sobre todo con el apoyo de mis seres queridos y de la mano de Dios.\"}]'),
