(1, 2, 16121054, '[{\"name\":\"rel-herm1\",\"value\":\"Con mi hermana tenemos los comunes problemas de hermanos, pero  en general nos llevamos muy bien y siempre nos apoyamos. Ninguna familia es perfecta.\"},{\"name\":\"act-herm1\",\"value\":\"Cariño.\"},{\"name\":\"rel-herm2\",\"value\":\"Mi hermanito y yo somos muy unidos y siempre jugamos juntos.\"},{\"name\":\"act-herm2\",\"value\":\"Cariño.\"},{\"name\":\"lig-afe\",\"value\":\"Padre\"},{\"name\":\"lig-por\",\"value\":\"Hablamos de todo y siempre me da consejos buenos.\"},{\"name\":\"ocu-dir\",\"value\":\"Papá y mamá \"},{\"name\":\"inf-dir\",\"value\":\"Nadie, yo tomé la decisión.\"},{\"name\":\"dat-fam\",\"value\":\"No.\"},{\"name\":\"rel-com\",\"value\":\"Buena\"},{\"name\":\"rel-por\",\"value\":\"Tengo facilidad para hacer amigos.\"},{\"name\":\"rel-ami\",\"value\":\"Muy cool, hacemos bromas pero siempre nos apoyamos.\"},{\"name\":\"rel-pro\",\"value\":\"Buena, existe respeto.\"},{\"name\":\"rel-aca\",\"value\":\"No he tenido ningún problema con nadie.\"},{\"name\":\"tie-lib\",\"value\":\"Entreno Football americano.\"},{\"name\":\"act-rec\",\"value\":\"El entrenamiento.\"},{\"name\":\"puntual\",\"value\":\"Frecuente\"},{\"name\":\"pun-obs\",\"value\":\"Ninguna\"},{\"name\":\"timido\",\"value\":\"No\"},{\"name\":\"tim-obs\",\"value\":\"Ninguna\"},{\"name\":\"alegre\",\"value\":\"Mucho\"},{\"name\":\"ale-obs\",\"value\":\"Ninguna\"},{\"name\":\"agresivo\",\"value\":\"Mucho\"},{\"name\":\"agr-obs\",\"value\":\"Cuando estoy en un partido. \"},{\"name\":\"ideas\",\"value\":\"Mucho\"},{\"name\":\"ide-obs\",\"value\":\"Ninguna\"},{\"name\":\"reflexivo\",\"value\":\"Mucho\"},{\"name\":\"rel-obs\",\"value\":\"Ninguna\"},{\"name\":\"constante\",\"value\":\"Mucho\"},{\"name\":\"con-obs\",\"value\":\"Ninguna\"},{\"name\":\"optimista\",\"value\":\"Mucho\"},{\"name\":\"opt-obs\",\"value\":\"Ninguna\"},{\"name\":\"constante\",\"value\":\"Frecuente\"},{\"name\":\"imp-obs\",\"value\":\"Tomo la vida como viene. \"},{\"name\":