er ordenada y saber dónde tengo todo. Me gusta tener confianza en mí, por que cuando eso falta las cosas empiezan a salir mal por las dudas que se crean. Quiero ser una persona exitosa.\"},{\"name\":\"ayu-esc\",\"value\":\"Siempre, en lo que me puedan ayudar.\"},{\"name\":\"pro-est\",\"value\":\"Ninguno, siempre que tengo que estudiar, lo hago.\"},{\"name\":\"ren-esc\",\"value\":\"Es bueno, en la prepa y la secundaria era excelente, aún me estoy acostumbrando a la universidad, pero soy buena estudiante.\"},{\"name\":\"asi-act\",\"value\":\"Fundamentos de programación, Matemáticas discretas, Cálculo Diferencia, Ética, Fundamentos de Investigación y Administración.\"},{\"name\":\"asi-pre\",\"value\":\"Fundamentos de programación y matemáticas discretas, te hacen pensar y ser más activo. \"},{\"name\":\"asi-sob\",\"value\":\"Deportes, jaja. En fundamentos de programación.\"},{\"name\":\"asi-des\",\"value\":\"Cálculo diferencial, mi maestro no me motiva a estudiar.\"},{\"name\":\"baj-pro\",\"value\":\"Es mi primer semestre \"},{\"name\":\"vie-tec\",\"value\":\"Por que es una escuela barata que tiene un super nivel académico, está cerca de mi casa, tiene buenas instalaciones y creo que saldré muy preparada para competir en el mundo real.\"},{\"name\":\"mot-tec\",\"value\":\"Cumplir mis sueños de ser una mujer exitosa.\"},{\"name\":\"pro-ant\",\"value\":\".\"},{\"name\":\"asi-repr\",\"value\":\".\"},{\"name\":\"pla-inm\",\"value\":\"Terminar la carrera, una maestría y salir de la ciudad para conseguir un buen trabajo. Demostrarle a todos que pude cumplir todas mis metas.\"},{\"name\":\"met-vid\",\"value\":\"Ser exitosa en mi carrera profesional, ayudar a mi comunidad, tener un gran pensamiento filosófico, ser QuarterBack en mi equipo y seguir aprendiendo algo nuevo todos los días. \"},{\"name\":\"nom-ent\",\"value\":\"José Manuel Cuin Jacuinde \"},{\"name\":\"yo-soy\",\"value\":\"Soy una chava con muchas metas, que tiene en mente que la vida es corta y que sólo con esfuerzo, dedicación y trabajo diario voy a conseguir cualquier cosa que me proponga.\"},{\"name\":\"car-es\",\"value\":\"Es paciente y calmado, el hecho de entrenar football me ha hecho aprender a respetar a mis superiores y siempre hacer lo que me pidan, sin decir \'no puedo\'. \"},{\"name\":\"gus-que\",\"value\":\"Me gusta que confíen en mí para hacer algo. \"},{\"name\":\"asp-vid\",\"value\":\"Lograr todo lo que he mencionado anteriormente, y siempre ser mejor cada día.  \"},{\"name\":\"mie-que\",\"value\":\"No miedo, más bien me da coraje que alguien me diga que no puedo hacer algo, sé que no hay límite. \"},{\"name\":\"que-log\",\"value\":\"Cualquier cosa si me dedico a ser mejor todos los días.\"}]'),
