(2, 1, 16121002, '[{\"name\":\"vid-6a\",\"value\":\"Me gradué del kinder y aprendí a leer\"},{\"name\":\"vid-12a\",\"value\":\"Me gradué de la primaria con honores, participe en la olimpiada del conocimiento y entre a la secundaria que quería \"},{\"name\":\"vid-15a\",\"value\":\"Me gradué de la secundaria, tuve buenas calificaciones, me aceptaron en el CBTIs 94 e hice buenos amigos\"},{\"name\":\"vid-18a\",\"value\":\"Me gradué del CBTIs 94 con un buen promedio y me aceptaron en el Tecnológico en la carrera que quería\"},{\"name\":\"vid-21a\",\"value\":\"Aun no llego a esa edad\"},{\"name\":\"vid-6b\",\"value\":\"Era mal alumno en el kinder\"},{\"name\":\"vid-12b\",\"value\":\"Me volví un poco asocial y me encerré en mi mundo\"},{\"name\":\"vid-15b\",\"value\":\"Eche a perder dos posibles relaciones amorosas (que tonto la neta)\"},{\"name\":\"vid-18b\",\"value\":\"Me volví muy asocial, baje mi promedio al entrar a la universidad por no agarrar el ritmo, me quede sin amigos y bajo mi motivación\"},{\"name\":\"vid-21b\",\"value\":\"Aun no llego a esa edad\"}]'),
(2, 1, 16121010, '[{\"name\":\"vid-6a\",\"value\":\"Termine el kinder, sabia escribir, leer, inglés muy basico\"},{\"name\":\"vid-12a\",\"value\":\"termine la primaria, entré a un equipo de natacion, gane mi primera medalla, termine la primaria con buenas calificaciones\"},{\"name\":\"vid-15a\",\"value\":\"termine la secundaria con buen promedio, tenia más medallas ganadas, me fui a otro estado a competir, tenía varios diplomas por excelencia academica y por deporte\"},{\"name\":\"vid-18a\",\"value\":\"termine la preparatoria con buen promedio, tenia una carrera en mi deporte, ya tenia varios conocimientos, tengo ganas de mas conocimientos, voy a iniciar mi carrera\"},{\"name\":\"vid-21a\",\"value\":\"espero ir bien en mi carrera, tener mucho más conocimiento, ser más sociable, seguir haciendo deporte al mismo nivel\"},{\"name\":\"vid-6b\",\"value\":\"no recuerdo muy bien\"},{\"name\":\"vid-12b\",\"value\":\"mi nivel al competir en mi deporte no era bueno\"},{\"name\":\"vid-15b\",\"value\":\"algunos fracasos en mi deporte\"},{\"name\":\"vid-18b\",\"value\":\"algunas bajas calificaciones en preparatoria\"},{\"name\":\"vid-21b\",\"value\":\"por venir\"}]'),
(2, 1, 16121011, '[{\"name\":\"vid-6a\",\"value\":\"buen promedio en la primaria\"},{\"name\":\"vid-12a\",\"value\":\"termino estudio de la primaria con promedio excelente, comienzan mis estudios en la secundaria, bajo de peso, comienzo a trabajar\"},{\"name\":\"vid-15a\",\"value\":\"termino estudios de la secundaria, comienzan estudios en el bachillerato, selección de futbol, selección de basketball y medalla de bronce en atletismo en la selección de atletismo\"},{\"name\":\"vid-18a\",\"value\":\"termino estudios en el bachilerato, comienzan estudios en el tecnológico\"},{\"name\":\"vid-21a\",\"value\":\"desarrollo de proyectos, buen promedio y comprensión de los temas para mi ingeniería\"},{\"name\":\"vid-6b\",\"value\":\"sobrepeso, timido y baja autoestima\"},{\"name\":\"vid-12b\",\"value\":\"timidez, fallece mi padre\"},{\"name\":\"vid-15b\",\"value\":\"peso bajo\"},{\"name\":\"vid-18b\",\"value\":\"falta de sueño, estrés, problemas familiares\"},{\"name\":\"vid-21b\",\"value\":\"falta de sueño. estrés y complicaciones para estudiar y trabajar, problemas complejos\"}]'),
(2, 1, 16121014, '[{\"name\":\"vid-6a\",\"value\":\"Terminé el nivel preescolar.\"},{\"name\":\"vid-12a\",\"value\":\"Terminé la primaria como el mejor alumno de la generación, concursé en las Olimpiadas del conocimiento infantil, participé en múltiples eventos y recibí numerosos reconocimientos.\"},{\"name\":\"vid-15a\",\"value\":\"Terminé la secundaria con excelencia académica y como el mejor alumno de la generación, gané un torneo oficial de ajedrez, participé en varios eventos escolares y comencé en el mundo del deporte.\"},{\"name\":\"vid-18a\",\"value\":\"Terminé con excelencia académica el nivel preparatoria, como el mejor alumno de la generación,, gané varios eventos y recibí varios reconocimientos. Obtuve mi licencia de conducir.\"},{\"name\":\"vid-21a\",\"value\":\"Terminé con honores la carrera en ingeniería en sistemas computacionales con las notas suficientes para continuar con una maestría. Tengo un trabajo estable.\"},{\"name\":\"vid-6b\",\"value\":\"Ninguna\"},{\"name\":\"vid-12b\",\"value\":\"ninguna\"},{\"name\":\"vid-15b\",\"value\":\"ninguna\"},{\"name\":\"vid-18b\",\"value\":\"Espero que ninguna\"},{\"name\":\"vid-21b\",\"value\":\"Espero que ninguna\"}]'),
(2, 1, 16121015, '[{\"name\":\"vid-6a\",\"value\":\"Sabia muy bien andar en bicicleta y era relativamente bueno para jugar futbol\"},{\"name\":\"vid-12a\",\"value\":\"entré con animos muy altos a la secundaria y tenia calificaciones muy buenas\"},{\"name\":\"vid-15a\",\"value\":\"tenia muy en mente lo que queria hacer para dejar mi huella en el mundo\"},{\"name\":\"vid-18a\",\"value\":\"elegí un lugar donde me gusta estar y con quien me gusta estar\"},{\"name\":\"vid-21a\",\"value\":\"N/A\"},{\"name\":\"vid-6b\",\"value\":\"no me dedicaba como es debido a mis estudios, no los veia importantes en aquel entonces\"},{\"name\":\"vid-12b\",\"value\":\"tenia peleas con muchas personas, tanto verbales como fisicas\"},{\"name\":\"vid-15b\",\"value\":\"de nuevo comencé a bajar mis calificaciones, no eran reprovatorias, pero no eran las mejores\"},{\"name\":\"vid-18b\",\"value\":\"soy demasiado flojo, pero aun no afecta tanto\"},{\"name\":\"vid-21b\",\"value\":\"N/A\"}]'),
(2, 1, 16121016, '[{\"name\":\"vid-6a\",\"value\":\"Ninguno.\"},{\"name\":\"vid-12a\",\"value\":\"Reconocimientos por buen desempeño escolar, participaciones en bailables, ganando la gran mayoría.\"},{\"name\":\"vid-15a\",\"value\":\"Reconocimientos por buen desempeño escolar.\"},{\"name\":\"vid-18a\",\"value\":\"Reconocimientos por buen desempeño escolar, participaciones en torneos de TaeKwonDo ganando en su gran mayoría primeros lugares.\"},{\"name\":\"vid-21a\",\"value\":\"Aun no tengo esa edad.\"},{\"name\":\"vid-6b\",\"value\":\"Ninguno.\"},{\"name\":\"vid-12b\",\"value\":\"Ninguno.\"},{\"name\":\"vid-15b\",\"value\":\"Ninguno.\"},{\"name\":\"vid-18b\",\"value\":\"Ninguno.\"},{\"name\":\"vid-21b\",\"value\":\"Aun no tengo esa edad.\"}]'),
(2, 1, 16121018, '[{\"name\":\"vid-6a\",\"value\":\"Realmente no tengo muchos recuerdos de todo lo que paso en este momento. Supongo mi mayor éxito a esa edad fue terminar el kinder.\"},{\"name\":\"vid-12a\",\"value\":\"Todo empezó con el skate, de alguna manera me di cuenta que me gustaban las emociones fuertes, pero no era muy bueno para este. Luego conocí el parkour y al fin me sentí libre, se convirtío en mi completo estilo de vida al grado que lo practicaba diario a todas horas y me hacia sentir muy bien hacer parkour\"},{\"name\":\"vid-15a\",\"value\":\"Me mude a Toluca al Tec de Monterrey y decidí unirme al equipo de robótica tecbot, donde me di cuenta del increible mundo que hay detrás de todas las ingenierías fuimos campeones nacionales en robótica de la temporada 2015-2016. Ahí también aprendi sobre muchas cosas, participe en varios hackatones y actividades de ese tipo. Y respecto a la escuela me gradue con promedio de 94, que me parecio muy bien.\"},{\"name\":\"vid-18a\",\"value\":\"A los 18 años entre al Tecnológico de Morelia, a la carrera de Sistemas Computacionales y actualmente estoy estudiando eso, me parece que voy muy bien en mis materias. \r\nTambién estoy trabajando para Corporativo JBK, una empresa de creación de páginas web, aplicaciones y marketing. \"},{\"name\":\"vid-21a\",\"value\":\"Tengo 18\"},{\"name\":\"vid-6b\",\"value\":\"Creo que no hubo ningún fracaso en este momento.\"},{\"name\":\"vid-12b\",\"value\":\"A los 12 años, mi vida estaba siendo un poco dura, aun no terminaba de aceptar que mis padres se habían separado y que tenía un medio hermano. Supongo esto mismo afecto mi rendimiento en la escuela.\"},{\"name\":\"vid-15b\",\"value\":\"Creo que aquí no hubo ningún fracaso, y si es que los hubo, aprendí lo suficiente de ellos como para verlos como oportunidades para aprender y no como fracasos\"},{\"name\":\"vid-18b\",\"value\":\"De nuevo, no ha habido ningún fracaso hasta ahora\"},{\"name\":\"vid-21b\",\"value\":\"Tengo 18\"}]'),
(2, 1, 16121023, '[{\"name\":\"vid-6a\",\"value\":\"practicaba deportes\r\nestaba estudiando en la primaria\r\nparticipaba en competencias\"},{\"name\":\"vid-12a\",\"value\":\"estaba en la secundaria\r\ntenia buenos amigos\r\ndestacaba en el deporte \r\nganaba competencias\"},{\"name\":\"vid-15a\",\"value\":\"estaba en la preparatoria \r\ntenia muy buenos amigos\r\nme iba bien en la escuela \r\ntenia buena relacion con compañeros y familia\"},{\"name\":\"vid-18a\",\"value\":\"me gradue de la preparatoria\r\ntengo buenos amigos \r\nlogre entrar a la escuela que queria\"},{\"name\":\"vid-21a\",\"value\":\"nada\"},{\"name\":\"vid-6b\",\"value\":\"nada\"},{\"name\":\"vid-12b\",\"value\":\"nada\"},{\"name\":\"vid-15b\",\"value\":\"fallecio alguien cercano a mi\"},{\"name\":\"vid-18b\",\"value\":\"reprobe 3 materias por problemas de adaptacion en el lugar de donde es la escuela\"},{\"name\":\"vid-21b\",\"value\":\"nada\"}]'),
(2, 1, 16121025, '[{\"name\":\"vid-6a\",\"value\":\"Haber participado durante la prmaria en un concurso llamado Olimpiada del Conocimineto.\"},{\"name\":\"vid-12a\",\"value\":\"Haber egresado de la primaria con excelentes calificaciones. Y haber participado en la Olimpiada del conocimiento a nivel estatal.\"},{\"name\":\"vid-15a\",\"value\":\"Haber seguido con un buen aprovechamiento escolar. Haber participado en varios concursos de matemáticas, física, química, informática, a niveles regionales, estatales, nacionales e incluso internacionales.\"},{\"name\":\"vid-18a\",\"value\":\"Haber egresado de la Preparatoria y después haber sido aceptado para continuar con mis estudios superiores en el Inttituto Tecnologico de Morelia\"},{\"name\":\"vid-21a\",\"value\":\"Espero seguir con un buen aprovechamiento escolar. Seguir participando en varios concuersos más, demostrar mis capacidades y poner en alto el nombre del Tecnologico.\"},{\"name\":\"vid-6b\",\"value\":\"Haber sufrido de bullying en la escuela.\"},{\"name\":\"vid-12b\",\"value\":\"No obtuve buenos resultados en la Olimpiada del conocimiento, y no me fue posible avanzar a la siguiente etapa.\"},{\"name\":\"vid-15b\",\"value\":\"Haber sufrido la pérdida de mi abuelo materno.\"},{\"name\":\"vid-18b\",\"value\":\"A mi padre le fue diagnosticado cáncer de próstata.\"},{\"name\":\"vid-21b\",\"value\":\"Espero que mi padre llegue a superar su enfermedad, para que él esté ahi conmigo, acompañandome como simpre en mi camino para lograr mis metas.\"}]'),
(2, 1, 16121026, '[{\"name\":\"vid-6a\",\"value\":\"Segundo lugar en carrera de velocidad en la primaria. \"},{\"name\":\"vid-12a\",\"value\":\"Participación en la olimpiada del conocimiento.\r\nMejor promedio de la generación.\"},{\"name\":\"vid-15a\",\"value\":\"Ninguno con relevancia.\"},{\"name\":\"vid-18a\",\"value\":\"Tercer lugar en concurso de habilidades matemáticas en la escuela preparatoria.\r\nTercer mejor promedio de la generación.\"},{\"name\":\"vid-21a\",\"value\":\"Todavía no llego a tal edad.\"},{\"name\":\"vid-6b\",\"value\":\"Actitud introvertida.\"},{\"name\":\"vid-12b\",\"value\":\"Actitud introvertida.\"},{\"name\":\"vid-15b\",\"value\":\"Falta de visión futurista.\"},{\"name\":\"vid-18b\",\"value\":\"Ninguno con relevancia.\"},{\"name\":\"vid-21b\",\"value\":\"Todavía no llego a tal edad.\"}]'),
(2, 1, 16121027, '[{\"name\":\"vid-6a\",\"value\":\"aprendí a leer y escribir\r\nperdí el temor a cambiar de dientes \r\nfui a esa edad de los mejores niños\"},{\"name\":\"vid-12a\",\"value\":\"aprendí a manejar autos\r\ningrese sin problemas a la secundaria\r\nfui muy popular entre los compañeros\"},{\"name\":\"vid-15a\",\"value\":\"tuve mi primer relación de noviazgo\r\ndisfrutaba de mi estadía en la escuela y aprendía mucho\r\nfui de los mas populares \r\ntenia una muy buena relación con mis maestros\"},{\"name\":\"vid-18a\",\"value\":\"termine la carrera técnica con mención honorifica y promedio de 9.7\r\ningrese al ITM en la carrera de ISC\r\nComencé a trabajar en Konexo (Dish México)\"},{\"name\":\"vid-21a\",\"value\":\"inicie un negocio propio (Centro de Servicios Informáticos)\r\ndecidí retomar mis estudios en la UMSNH\r\nme esforcé en tener una estabilidad en todo sentido \"},{\"name\":\"vid-6b\",\"value\":\"poca atención por parte de mis papas académica mente\r\n\"},{\"name\":\"vid-12b\",\"value\":\"falta de interés nato en cuestiones académicas\"},{\"name\":\"vid-15b\",\"value\":\"falta de madurez en mi persona para llevar una relación \r\ntuve varios tropiezos por falta de autoseguridad \"},{\"name\":\"vid-18b\",\"value\":\"desespere por la dificultad económica que tenia entonces y decidí dejar la escuela para trabajar\r\nno me decidí entonces a continuar con mis estudios \r\nperdía mucho tiempo viendo televisión y gastando lo poco que generaba\"},{\"name\":\"vid-21b\",\"value\":\"deje mis estudios en la UMSNH\r\ny desaproveche la oportunidad de crecer rapidamente mi negocio\"}]'),
(2, 1, 16121029, '[{\"name\":\"vid-6a\",\"value\":\"Creo que de niño no tuve un logro importante, pero un exito pudo ser que acabe el kinder . \"},{\"name\":\"vid-12a\",\"value\":\"Me gustaba el Futbol fue cuando obtuve una medalla y luego gane un trofeo jugando basket. \"},{\"name\":\"vid-15a\",\"value\":\"En la secundaria obtuve diferentes logros, ya sean deportivos, academicos culturales, etc.\"},{\"name\":\"vid-18a\",\"value\":\"Fui a diferentes torneos, fui de los mejores de mi escuela, dije el discurso de graduacion y creo que fue la mejor etapa de mi vida.\"},{\"name\":\"vid-21a\",\"value\":\"aun no tengo 21\"},{\"name\":\"vid-6b\",\"value\":\"Ninguno \"},{\"name\":\"vid-12b\",\"value\":\"Que era muy enfermizo y a veces no podia jugar mucho. \"},{\"name\":\"vid-15b\",\"value\":\"A la edad de los 15 años creo que era demasiado inocente.\"},{\"name\":\"vid-18b\",\"value\":\"He sufrido tambien muchos fracasos como amorosos mas que nada, y tambien lo tuve con algunos amigos.\"},{\"name\":\"vid-21b\",\"value\":\"aun no tengo 21\"}]'),
(2, 1, 16121036, '[{\"name\":\"vid-6a\",\"value\":\"Ingresar a la primaria y destacar en mi grupo\"},{\"name\":\"vid-12a\",\"value\":\"Acabar con promedio casi perfecto la primaria, poder ingresar a la secundaria.\"},{\"name\":\"vid-15a\",\"value\":\"Ser uno de los mejores alumnos de mi salón de secundaria, Ingresar a la preparatoria  \"},{\"name\":\"vid-18a\",\"value\":\"Terminar la preparatoria sin problema alguno, Ingresar a la universidad\"},{\"name\":\"vid-21a\",\"value\":\"No los cumplo aun\"},{\"name\":\"vid-6b\",\"value\":\"Acostumbrarme al cambio de primaria que había tenido e intentar acoplarme a este nuevo modo de vida.\"},{\"name\":\"vid-12b\",\"value\":\"Superar mi asocialidad para poder tener amigos.\"},{\"name\":\"vid-15b\",\"value\":\"Empezar a crear un carácter y una personalidad que aun estaban ausentes en mi\"},{\"name\":\"vid-18b\",\"value\":\"Tener que acostumbrarme al sistema universitario y a vivir en una casa rentada con compañeros\"},{\"name\":\"vid-21b\",\"value\":\"No los cumplo aun\"}]'),
(2, 1, 16121041, '[{\"name\":\"vid-6a\",\"value\":\"Ir a una olimpiada del conocimiento.\"},{\"name\":\"vid-12a\",\"value\":\"Tener varios campeonatos de futbol, mejorar en este deporte y tener un promedio casi perfecto en la primaria\"},{\"name\":\"vid-15a\",\"value\":\"Terminar la secundaria y lograr el ingreso a la preparatoria.\"},{\"name\":\"vid-18a\",\"value\":\"Casi terminar la preparatoria y estar en selectivos deportivos\"},{\"name\":\"vid-21a\",\"value\":\"Estar estudiando la universidad por un momento.\"},{\"name\":\"vid-6b\",\"value\":\"Ser sedentario en aquel entonces y tener sobrepeso\"},{\"name\":\"vid-12b\",\"value\":\"Disminuir mis calificaciones por mala relación con mis padres\"},{\"name\":\"vid-15b\",\"value\":\"Problemas con mis padres y no entendernos\"},{\"name\":\"vid-18b\",\"value\":\"Dejar de lado el interés de mis padres por mi bien y buscar mis propias decisiones\"},{\"name\":\"vid-21b\",\"value\":\"Desidia y perdida de interés por las cosas que no son de mi agrado \"}]'),
(2, 1, 16121043, '[{\"name\":\"vid-6a\",\"value\":\"Logré ser un alumno importante en el jardín de niños\"},{\"name\":\"vid-12a\",\"value\":\"Salí de la primaria con un promedio destacado\"},{\"name\":\"vid-15a\",\"value\":\"Completé la Secundaria con un promedio de excelencia,\r\naprendí a tocar batería, adquirí una buena beca, me volví muy seguro, conocí a personas muy importantes en mi vida.\"},{\"name\":\"vid-18a\",\"value\":\"Logré salir de la preparatoria con un promedio de excelencia, ingresé al tecnológico de Morelia, musicalmente crecí mucho.\"},{\"name\":\"vid-21a\",\"value\":\"Aún no cumplo 21\"},{\"name\":\"vid-6b\",\"value\":\"Era un niño muy miedoso\"},{\"name\":\"vid-12b\",\"value\":\"Tenía mucha inseguridad y baja autoestima\"},{\"name\":\"vid-15b\",\"value\":\"Mis padres me limitaban mucho en el sentido musical\"},{\"name\":\"vid-18b\",\"value\":\"Me costó mucho acoplarme a la universidad y por ende bajé un poco mis calificaciones\"},{\"name\":\"vid-21b\",\"value\":\"Aún no cumplo 21\"}]'),
