(2, 1, 16121056, '[{\"name\":\"vid-6a\",\"value\":\"Terminar el jardín de niños\r\nEntre a estudia la primaria\r\nobtuve el primer lugar de aprovechamiento en la primaria\"},{\"name\":\"vid-12a\",\"value\":\"Termine la primaria\r\nGané 1 concurso de dibujo a nivel estatal en la Secretaria del medio ambiente\r\nGane 1 concurso se dibujo a nivel municipal\r\ngane 1 concurso de dibujo en mi escuela\"},{\"name\":\"vid-15a\",\"value\":\"Termine la secundaria\r\n\"},{\"name\":\"vid-18a\",\"value\":\"termine un curso de electricidad, uno de reparacion de aparatos electrodomésticos y un curso de embobinado de motores\"},{\"name\":\"vid-21a\",\"value\":\"termine la preparatoria \r\nentre a estudiar al Instituto Tecnológico de Morelia\"},{\"name\":\"vid-6b\",\"value\":\"ninguno\"},{\"name\":\"vid-12b\",\"value\":\"Me cambie de escuela primaria 3 veces\"},{\"name\":\"vid-15b\",\"value\":\"ninguno\"},{\"name\":\"vid-18b\",\"value\":\"Estuve un año recursando una materia en mi preparatoria\"},{\"name\":\"vid-21b\",\"value\":\"ninguno\"}]'),
(2, 1, 16121058, '[{\"name\":\"vid-6a\",\"value\":\"Ser una gran persona y poder estudiar en una escuela que al dia de hoy, estoy orgulloso de ello\"},{\"name\":\"vid-12a\",\"value\":\"Logre entrar a la secundaria, me llevaba bien con mis pocos amigos que tenia\"},{\"name\":\"vid-15a\",\"value\":\"Me empece a edsenvolver mas con las persona, tenia mas amigos, hablaba mas, no tenia tanta timidez\"},{\"name\":\"vid-18a\",\"value\":\"Eh mejorado en mi rendimiento escolar, soy mas responsable\"},{\"name\":\"vid-21a\",\"value\":\"nada\"},{\"name\":\"vid-6b\",\"value\":\"Me costaba trabajo hablar con las personas, no hacia cosas que no me gustaran.\"},{\"name\":\"vid-12b\",\"value\":\"Seguia demasiado timido, no me gustaba que la gente me tratara mal.\"},{\"name\":\"vid-15b\",\"value\":\"Sufria bullying por parte de algunas personas, mi rendimiendo escolar era muy malo\"},{\"name\":\"vid-18b\",\"value\":\"Soy un poco necio, terco, etc\"},{\"name\":\"vid-21b\",\"value\":\"nada\"}]'),
