(2, 1, 16121062, '[{\"name\":\"vid-6a\",\"value\":\"Solía tener buenas calificaciones y muchos amigos, jugaba con ellos, hacía ejercicio.\"},{\"name\":\"vid-12a\",\"value\":\"Mi promedio seguía igual, tenía buenos amigos.\"},{\"name\":\"vid-15a\",\"value\":\"Comencé a entrar en la música y en el mundo de la computadora y programación\"},{\"name\":\"vid-18a\",\"value\":\"Conseguí juntar a un grupo de personas por un bien común\"},{\"name\":\"vid-21a\",\"value\":\"No he llegado.\"},{\"name\":\"vid-6b\",\"value\":\"Me operaron.\"},{\"name\":\"vid-12b\",\"value\":\"Dejé el ejercicio, y no tenía tantos amigos\"},{\"name\":\"vid-15b\",\"value\":\"Mi promedio bajó y tenía más distracciones\"},{\"name\":\"vid-18b\",\"value\":\"Me quedé como idiota siguiendo una persona durante un año y medio\"},{\"name\":\"vid-21b\",\"value\":\"No he llegado.\"}]'),
