(2, 1, 16121287, '[{\"name\":\"vid-6a\",\"value\":\"Iniciando mi forma de ser siendo positivo ante las circunstancias, participativo y siendo sociable\"},{\"name\":\"vid-12a\",\"value\":\"Terminar la primaria con buenas calificaciones y cursando en una buena secundaria \"},{\"name\":\"vid-15a\",\"value\":\"Iniciarme en nivel superior\"},{\"name\":\"vid-18a\",\"value\":\"cumplir mi mi meta de entrar al instituto Tecnologico de Morelia \"},{\"name\":\"vid-21a\",\"value\":\"aun no tengo 21\"},{\"name\":\"vid-6b\",\"value\":\"No teniendo fracasos a esa edad \"},{\"name\":\"vid-12b\",\"value\":\"Limitaciones al momento de querer salir a divertirme con amigos\"},{\"name\":\"vid-15b\",\"value\":\"No tener exito en algunas materias\"},{\"name\":\"vid-18b\",\"value\":\"Tiempo para mi vida social\"},{\"name\":\"vid-21b\",\"value\":\"aun no tengo 21\"}]'),
(2, 1, 16121292, '[{\"name\":\"vid-6a\",\"value\":\"comenze la primaria, y obtuve siempre buenas calificaciones obteniendo siempre primer y segundo lugar de mi salon.\"},{\"name\":\"vid-12a\",\"value\":\"comenzaba la secundaria, en donde tambien siempre tube buenas calificaciones, entrando a diferentes concursos internos.\"},{\"name\":\"vid-15a\",\"value\":\"a los 15 años comenzaba la preparatoria, en donde tambien me iva muy bien en calificaciones y comenze a obtar mucho por la informatica, y comunicaciones, optando por esta carrera\"},{\"name\":\"vid-18a\",\"value\":\"a los 18 años, ingrese a el Tecnologico de Morelia, ingresando a una gran carrera ITICS, la cual cubre mis espectativas, para poder ser una gran profecionista. \"},{\"name\":\"vid-21a\",\"value\":\"en aproximadamente dos años espero estar a la mitad de mi carrera, anhelando ahun mas terminarla para comenzar en el hambito profecional.\"},{\"name\":\"vid-6b\",\"value\":\"un fracaso a esta edad, tal vez fue un poco de estabilidad en un momento dado, debido a un problema familiar.\"},{\"name\":\"vid-12b\",\"value\":\"Un tropiezo tal vez fue, debido a cambios de humor por los cuales, pasaba en principios, despues todo fue normal.\"},{\"name\":\"vid-15b\",\"value\":\"un tropiezo, tal vez fue el cambio de secundaria a preparatoria, y tambien un poco de desconcentracion, debido a una relacion. \"},{\"name\":\"vid-18b\",\"value\":\"Un gran tropiezo fue en el ciclo 2015, no haber podido ingresar a el Tecnológico terminando mis estudios de preparatoria, debido a no haber pasado el examen de admisión.\"},{\"name\":\"vid-21b\",\"value\":\"Espero no tener ningun tropiezo, y continuar satisfactoriamente mi carrera.\"}]'),
(2, 1, 16121293, '[{\"name\":\"vid-6a\",\"value\":\"Ingrese a la primaria, ademas de jugar en mi primer equipo de futbol\"},{\"name\":\"vid-12a\",\"value\":\"Entre a la secundaria. Varios torneos de futbol a partes de la republica. Salir de la primaria\"},{\"name\":\"vid-15a\",\"value\":\"Conocí de Dios, cambio mi vida totalmente. Empece a practicar musica. Entre al bachillerato. Todo mejoro en mi familia. Salir de la Secundaria.\"},{\"name\":\"vid-18a\",\"value\":\"Entre a la universidad. Conciertos de musica. Cursos de video, fotografia. Salir de la Prepa\"},{\"name\":\"vid-21a\",\"value\":\"ninguna\"},{\"name\":\"vid-6b\",\"value\":\"Ninguno\"},{\"name\":\"vid-12b\",\"value\":\"Mis padres medio se querían divorciar. Fiestas donde salia mal con amigos\"},{\"name\":\"vid-15b\",\"value\":\"Ninguna\"},{\"name\":\"vid-18b\",\"value\":\"Malos trabajos.\"},{\"name\":\"vid-21b\",\"value\":\"ninguno\"}]'),
(2, 1, 16121295, '[{\"name\":\"vid-6a\",\"value\":\"Hablar, caminar\"},{\"name\":\"vid-12a\",\"value\":\"Tener buenas calificaciones, perder peso\"},{\"name\":\"vid-15a\",\"value\":\"Tener buenas calificaciones\"},{\"name\":\"vid-18a\",\"value\":\"Terminar la preparatoria con un buen promedio\"},{\"name\":\"vid-21a\",\"value\":\"No tengo 21\"},{\"name\":\"vid-6b\",\"value\":\"No sé\"},{\"name\":\"vid-12b\",\"value\":\"No sé\"},{\"name\":\"vid-15b\",\"value\":\"No sé\"},{\"name\":\"vid-18b\",\"value\":\"Dejar el ejercicio por limitaciones físicas y emocionales.\"},{\"name\":\"vid-21b\",\"value\":\"nada\"}]');
INSERT INTO `respuestas` (`idAnexo`, `subAnexo`, `idAlumno`, `respuestas`) VALUES
(2, 1, 16121300, '[{\"name\":\"vid-6a\",\"value\":\"Aprendí a escribir y a leer\r\nEntre a la Escuela primaria\r\n\r\n\"},{\"name\":\"vid-12a\",\"value\":\"Había salido de la primaria con el mejor promedio de la escuela y de mi generación.\r\nIngrese a la Secundaria que me había propuesto como mi primera opción.\r\n\"},{\"name\":\"vid-15a\",\"value\":\"Logre Graduarme de la Secundaria\r\nLogre entrar a la Preparatoria \r\nLas materias se empezaron a ser mas faciles\"},{\"name\":\"vid-18a\",\"value\":\"Aun no los cumplo\"},{\"name\":\"vid-21a\",\"value\":\"Aun no los cumplo\r\nEspero aprender bien Japones e ingles\"},{\"name\":\"vid-6b\",\"value\":\"Me volví muy asocial\r\nSe me dificultaba exponer mi punto de vista\r\nLe tenia miedo a mis padres.\"},{\"name\":\"vid-12b\",\"value\":\"Aun se me dificultaba hablar con los demás \r\nMe fue mal en las materias que tenían que ver con  aritmética y matemáticas\"},{\"name\":\"vid-15b\",\"value\":\"Caí en depresión, y tuve que ir con un psicólogo y un psiquiatra.\"},{\"name\":\"vid-18b\",\"value\":\"Aun no los cumplo\"},{\"name\":\"vid-21b\",\"value\":\"Aun no los cumplo\"}]'),
(2, 1, 16121301, '[{\"name\":\"vid-6a\",\"value\":\"Andar en bicicleta, leer,escribir, era disciplinado etc.\"},{\"name\":\"vid-12a\",\"value\":\"Terminar primaria y entrar a una buena secundaria\"},{\"name\":\"vid-15a\",\"value\":\"Primer novia, mejorar mis promedio, sociabilidad, bailar, etc.\"},{\"name\":\"vid-18a\",\"value\":\"Terminar preparatoria, Mas disciplinado, claridad de lo que quiero , disfrutar mi carrera.\"},{\"name\":\"vid-21a\",\"value\":\"-----\"},{\"name\":\"vid-6b\",\"value\":\"Violento, Hiperactivo., \"},{\"name\":\"vid-12b\",\"value\":\"Antisocial,, Marginado, \"},{\"name\":\"vid-15b\",\"value\":\"Irresponsabilidad, indisciplina,mala actitud, etc\"},{\"name\":\"vid-18b\",\"value\":\"Irresponsabilidad, actitud positiva\"},{\"name\":\"vid-21b\",\"value\":\"------\"}]'),
(2, 1, 16121302, '[{\"name\":\"vid-6a\",\"value\":\"Estaba en la escuela en segundo grado.\r\nYa sabia leer\"},{\"name\":\"vid-12a\",\"value\":\"Ingrese a la Secundaria y era un etapa nueva para mi.\"},{\"name\":\"vid-15a\",\"value\":\"Termine con exito mi secundari e ingrese a la preparatoria.\r\nHice muchos amigos\"},{\"name\":\"vid-18a\",\"value\":\"Actualmente estoy en la universidad la mejor etapa de mi vida\"},{\"name\":\"vid-21a\",\"value\":\"Espero seguir con mi carrera\"},{\"name\":\"vid-6b\",\"value\":\"No tenia fracasos por el momento\"},{\"name\":\"vid-12b\",\"value\":\"No me gusta la idea de dejar a mis amigos de la escuela ni la escolta de la escuela.\"},{\"name\":\"vid-15b\",\"value\":\"No me gustaba reprobar materias ya que habia reprobado algunas.\"},{\"name\":\"vid-18b\",\"value\":\"El primer años no pude ingresar al tecnologico y tuve que tranajar.\"},{\"name\":\"vid-21b\",\"value\":\"No tener fracasos en ese tiempo\"}]'),
(2, 1, 16121304, '[{\"name\":\"vid-6a\",\"value\":\"ganadora en un concurso de declamacion en ingles\"},{\"name\":\"vid-12a\",\"value\":\"termine estudios basicos de ingles\"},{\"name\":\"vid-15a\",\"value\":\"entrar a la preparatoria\"},{\"name\":\"vid-18a\",\"value\":\"Terminar la preparatoria con un buen promedio\"},{\"name\":\"vid-21a\",\"value\":\"-\"},{\"name\":\"vid-6b\",\"value\":\"el cambio de cuidad \"},{\"name\":\"vid-12b\",\"value\":\"-\"},{\"name\":\"vid-15b\",\"value\":\"primer extraoridanio en un materia reprobada\"},{\"name\":\"vid-18b\",\"value\":\"no pasar el examen e admision a la UNAM\r\nAsi mismo deserción de carrera en la UMSNH\"},{\"name\":\"vid-21b\",\"value\":\"-\"}]'),
(2, 1, 16121306, '[{\"name\":\"vid-6a\",\"value\":\"Destaque en aprovechamiento en la primaria\"},{\"name\":\"vid-12a\",\"value\":\"termine la primaria con uno de los mejores promedios\"},{\"name\":\"vid-15a\",\"value\":\"termine la secundaria con uno de los mejores aprovechamientos.\"},{\"name\":\"vid-18a\",\"value\":\"me gradue de la preparatoria con uno de los mejores promedios.\r\nparticipe como voluntario en varios eventos sociales.\r\n\"},{\"name\":\"vid-21a\",\"value\":\"aun no pasa :v\"},{\"name\":\"vid-6b\",\"value\":\"no era muy sociable\"},{\"name\":\"vid-12b\",\"value\":\"no logre entrar en la olimpiada estatal de matematicas\"},{\"name\":\"vid-15b\",\"value\":\"tuve problemas con unos maestros\"},{\"name\":\"vid-18b\",\"value\":\"tuve problemas con un profesor por que se equivoco con mis calificaciones \"},{\"name\":\"vid-21b\",\"value\":\"aun no pasa :v\"}]'),
(2, 1, 16121308, '[{\"name\":\"vid-6a\",\"value\":\"Obtencion de una beca por buenas calificaciones\"},{\"name\":\"vid-12a\",\"value\":\"Logre estar en el cuadro de honor de mi secundaria\r\n\"},{\"name\":\"vid-15a\",\"value\":\"Logre graduarme de la secundaria\r\n\"},{\"name\":\"vid-18a\",\"value\":\"Aprendi a tocar diversos instrumentos\r\nCompuse canciones\r\nLogre mi sueño de cantar como solista\r\nFui Cantautora\r\nme gradue de la preparatoria\r\nGane un concurso de cantautores\r\nSali con buenas calificaciones de mi escuela\r\nA los 19 logre ingresar al TEC \"},{\"name\":\"vid-21a\",\"value\":\"Espero seguir con buenas calificaciones\r\nParticipar en diversos concursos\"},{\"name\":\"vid-6b\",\"value\":\"Ninguno\"},{\"name\":\"vid-12b\",\"value\":\"Depresion\r\nProblemas familiares\"},{\"name\":\"vid-15b\",\"value\":\"No quede en la preparatoria de mi eleccion\r\nDepresion\r\nProblemas monetarios\r\nProblemas familiares\r\nProblemas de amistades\"},{\"name\":\"vid-18b\",\"value\":\"Porlemas monetarios\r\nProblemas familiares\r\nPerdidas familiares\"},{\"name\":\"vid-21b\",\"value\":\"Problemas monetarios\r\nProblemas familiares\"}]'),
(2, 1, 16121312, '[{\"name\":\"vid-6a\",\"value\":\"concluir preescolar\"},{\"name\":\"vid-12a\",\"value\":\"concluir primaria\"},{\"name\":\"vid-15a\",\"value\":\"concluir secundaria\"},{\"name\":\"vid-18a\",\"value\":\"concluir bachillerato\"},{\"name\":\"vid-21a\",\"value\":\"re-ingresar a la educación superior\"},{\"name\":\"vid-6b\",\"value\":\"nada\"},{\"name\":\"vid-12b\",\"value\":\"nada\"},{\"name\":\"vid-15b\",\"value\":\"una materia reprovada\"},{\"name\":\"vid-18b\",\"value\":\"haber ingresado a la UTM, problemas vocacionales y económicos\"},{\"name\":\"vid-21b\",\"value\":\"mal desempeño académico\"}]'),
(2, 1, 16121317, '[{\"name\":\"vid-6a\",\"value\":\"Gané el primer lugar en la olimpiada del conocimiento\"},{\"name\":\"vid-12a\",\"value\":\"Tuve uno de los mejores promedios de la escuela\"},{\"name\":\"vid-15a\",\"value\":\"Entré en el Bachillerato que quería solo por mis conocimientos\"},{\"name\":\"vid-18a\",\"value\":\"Tuve la oportunidad de ser alguien mas responsable, con deberes, lo cual me agrada.\r\nIngresé a la Universidad que quería y a la carrera que me gusta, solo usando mi conocimiento\"},{\"name\":\"vid-21a\",\"value\":\"No tengo esa edad\"},{\"name\":\"vid-6b\",\"value\":\"Ninguno\"},{\"name\":\"vid-12b\",\"value\":\"Ninguno\"},{\"name\":\"vid-15b\",\"value\":\"Ninguno\"},{\"name\":\"vid-18b\",\"value\":\"Ninguno\"},{\"name\":\"vid-21b\",\"value\":\"No tengo esa edad\"}]'),
(2, 1, 16121570, '[{\"name\":\"vid-6a\",\"value\":\"Sacar buenas calificaciones\r\nObtener los primeros lugares de promedio en mi salón\r\nObtener diplomas\"},{\"name\":\"vid-12a\",\"value\":\"Sacar buenas calificaciones\r\nObtener diplomas\r\nAparecer en el cuadro de honor\"},{\"name\":\"vid-15a\",\"value\":\"Sacar buenas calificaciones\r\nTener más confianza en mi familia\"},{\"name\":\"vid-18a\",\"value\":\"Aprender a nadar\r\nPerder el miedo a exponer en inglés\r\nTerminar la preparatoria \"},{\"name\":\"vid-21a\",\"value\":\"Aun no tengo esta edad\"},{\"name\":\"vid-6b\",\"value\":\"No poder aprender inglés de manera adecuada\"},{\"name\":\"vid-12b\",\"value\":\"No recuerdo\"},{\"name\":\"vid-15b\",\"value\":\"No recuerdo\"},{\"name\":\"vid-18b\",\"value\":\"No poder viajar a León a estudiar por falta de dinero\"},{\"name\":\"vid-21b\",\"value\":\"Aun no tengo esta edad\"}]'),
(2, 1, 16121572, '[{\"name\":\"vid-6a\",\"value\":\"Aprender a andar en bicicleta.\r\nRecuperacion de operacion.\r\nTerminacion de kinder e ingreso a primaria.\r\n\"},{\"name\":\"vid-12a\",\"value\":\"Desfilé por parte de la primaria.\r\nConoci a buenas amistades durante 6 años \r\nSalí en bicicleta por parte de la primaria sobre la calzada juarez. \r\nprimeros telefonos y reproductores de musica.\r\nIda al cine todos los años por parte de la primaria\r\nPrimera vez en andar en transporte publico sola.\r\nTerminacion de primaria y empezar en la secundaria tecnica 120.\"},{\"name\":\"vid-15a\",\"value\":\"Terminacion de Secundaria e ingreso a la preparatoria (CBTIS 149)  en la secundaria hice muchos amigos durante mi estancia ahi, y conserve a los mejores al terminar la secundaria. Tuve mis primeros novios. \r\nhice todo tipo de amistades.\r\nRecorde mi amor hacia los toros de la temporada de carnaval por que sali con mis vecinos y llegue tarde al dia siguiente, tenia como 14 años.  \"},{\"name\":\"vid-18a\",\"value\":\"Terminacion de Preparatoria e ingreso a la universidad.\r\nLogre terminar el bachillerato en contabilidad en el cbtis 149 con amistades verdaderas que marcaron y marcaran mi vida. \r\nMi primer escape a un concierto con mi mejor amiga. \r\nA la edad de 16 tuve una relacion bonita con alguien fueras de morelia en el rancho de donde son mis tios, durante unas vacaciones de invierno que pase haya pero duramos poco por que tuvimos un problema y a falta de madurez no supimos resolverlo. \r\n Descucbri mi amor por los Jaripeos y el Rancho donde viven mis tios.\r\nTengo mas libertad para salir a fiestas pero no la suficiente que me gustaria. \r\nTengo la confianza necesaria hacia mis papas. \r\nDesde el 27/03/2016 Llevo la mejor relacion que he podido tener.  \"},{\"name\":\"vid-21a\",\"value\":\"Espero haber terminado mi carrera y seguir con la pareja que tengo ahora.\"},{\"name\":\"vid-6b\",\"value\":\"no quise salir en la escolta del kinder. \"},{\"name\":\"vid-12b\",\"value\":\"Solo obtuve un diploma de ingles en primer año de primaria. \r\nJamas le guste a quien me gustaba en la primaria. \"},{\"name\":\"vid-15b\",\"value\":\"No sabia a que preparatoria entrar \r\nlo decidi como un mes antes y no me arrepiento de mi eleccion.\r\nTuve una relacion toxica y por consecuencia problemas con mis papas. \"},{\"name\":\"vid-18b\",\"value\":\"Operacion\r\nreproble en la preparatoria 2 materia (ambas de matematicas) \r\nTermine una relacion a la cual yo le veia futuro.\r\nConsidero que es malo que de vez en cuando tome alcohol y fume.\r\nSoy celosa. \"},{\"name\":\"vid-21b\",\"value\":\"...\"}]'),
(2, 1, 16121573, '[{\"name\":\"vid-6a\",\"value\":\"INICIO DE PRIMARIA\"},{\"name\":\"vid-12a\",\"value\":\"TERMINO DE LA PRIMARIA Y CINTA NEGRA EN TAE KWON DO\"},{\"name\":\"vid-15a\",\"value\":\"TERMINO DE SECUNDARIA\"},{\"name\":\"vid-18a\",\"value\":\"TÉRMINO DE LA PREPARATORIA Y COMPETENCIA NACIONAL EN TAE KWON DO\"},{\"name\":\"vid-21a\",\"value\":\"A LOS 22 AÑOS, TERMINÉ MI DIPLOMADO EN LA ENSEÑANZA DEL INGLÉS\"},{\"name\":\"vid-6b\",\"value\":\"TIMIDEZ\"},{\"name\":\"vid-12b\",\"value\":\"SER INTROVERTIDO\"},{\"name\":\"vid-15b\",\"value\":\"NO RECUERDO\"},{\"name\":\"vid-18b\",\"value\":\"AL INICIO DE LA LICENCIATURA\"},{\"name\":\"vid-21b\",\"value\":\"LIGEROS PROBLEMAS FAMILIARES\"}]'),
(2, 1, 16121574, '[{\"name\":\"vid-6a\",\"value\":\"Recibí un reconocimiento por el mejor promedio de mi salón de primaria \"},{\"name\":\"vid-12a\",\"value\":\"Participé en la olimpiada del conocimiento \"},{\"name\":\"vid-15a\",\"value\":\"Gané el concurso de lectura estatal \"},{\"name\":\"vid-18a\",\"value\":\"Gané dos concursos de ortografía \"},{\"name\":\"vid-21a\",\"value\":\"aun no tengo esa edad \"},{\"name\":\"vid-6b\",\"value\":\"Creo que ninguno \"},{\"name\":\"vid-12b\",\"value\":\"ninguno \"},{\"name\":\"vid-15b\",\"value\":\"ninguno \"},{\"name\":\"vid-18b\",\"value\":\"ninguno \"},{\"name\":\"vid-21b\",\"value\":\"ninguna \"}]'),
(2, 1, 16121575, '[{\"name\":\"vid-6a\",\"value\":\"Aprendí a leer y sali del kinder\"},{\"name\":\"vid-12a\",\"value\":\"Sali de la primaria con excelente promedio, muchos amigos\"},{\"name\":\"vid-15a\",\"value\":\"Sali de la secundaria con buenos amigos, excelentes calificaciones y reconocimientos academicos, deportivos.\"},{\"name\":\"vid-18a\",\"value\":\"Sali de la preparatoria la cual fue una excelente etapa lleva de experiencia, logre entrar al tecnológico para continuar con mis estudios\"},{\"name\":\"vid-21a\",\"value\":\"aun no tengo esa edad pero espero estar mas cerca de mis objetivos como profesionista.\"},{\"name\":\"vid-6b\",\"value\":\"Alejamiento paterno\"},{\"name\":\"vid-12b\",\"value\":\"me cambie de casa y escuela.\"},{\"name\":\"vid-15b\",\"value\":\"no tuve ningun fracaso, tal ves las limitaciones fueron no salir muy seguido a diversos lugares \"},{\"name\":\"vid-18b\",\"value\":\"Mi nivel académico a reducido un poco sin ebargo continuo.\"},{\"name\":\"vid-21b\",\"value\":\"Adquirir conocimientos con base a experiencias cometiendo errores.\"}]'),
(2, 1, 16121579, '[{\"name\":\"vid-6a\",\"value\":\"Aprender a leer y escribir\r\nSocializar fácilmente con los demás\r\nFacilidad de palabra\"},{\"name\":\"vid-12a\",\"value\":\"Entrar a una secundaria que ni siquiera sabía que existía.\r\nPoder acceder a cualquier lugar que yo quisiera, debido a que a ya aparentaba la mayoría de edad.\"},{\"name\":\"vid-15a\",\"value\":\"Fue fundamental, conocí una enorme cantidad de personas y esas personas hicieron que conociera a otras. Lo que comenzó una forjación de personalidad muy sociable.\"},{\"name\":\"vid-18a\",\"value\":\"Aún no tengo esa edad\"},{\"name\":\"vid-21a\",\"value\":\"Aún no tengo esa edad.\"},{\"name\":\"vid-6b\",\"value\":\"No poder salir con libertad a distintos sitios\r\nFalta de una figura paterna\"},{\"name\":\"vid-12b\",\"value\":\"Primeras decepciones amorosas.\r\nIntegración repentina a un nuevo salón de clases debido a un cambio de turno en la misma escuela, pero fue bastante difícil debido a que las clases ya habían comenzado y ningún profesor me apoyo.\"},{\"name\":\"vid-15b\",\"value\":\"Me rompieron el corazón de la forma más fea así como, aparecieron y se fueron, importantes personas de mi lado\"},{\"name\":\"vid-18b\",\"value\":\"aún no tengo esa edad\"},{\"name\":\"vid-21b\",\"value\":\"Aún no tengo esa edad.\"}]'),
(2, 1, 16121580, '[{\"name\":\"vid-6a\",\"value\":\"Terminación del Kinder, Empezaba a prender ingles, sabia hablar, caminar y escribir al 100%. \"},{\"name\":\"vid-12a\",\"value\":\"Termiacion de primaria y sabia tocar guitarra.\"},{\"name\":\"vid-15a\",\"value\":\"Jugador de Fútbol americano, tuve novia, aprendí a manejar y terminación de secundaria. \"},{\"name\":\"vid-18a\",\"value\":\"Jugador de Fútbol Americano, terminación de preparatoria,  hice muchos amigos .\"},{\"name\":\"vid-21a\",\"value\":\"Todavía no llego. \"},{\"name\":\"vid-6b\",\"value\":\"No recuerdo.\"},{\"name\":\"vid-12b\",\"value\":\"Mucha indisciplina. \"},{\"name\":\"vid-15b\",\"value\":\"Empece a tomar y fumar. \"},{\"name\":\"vid-18b\",\"value\":\"Tomaba mucho y la fiesta se empezó a descontrolar. \"},{\"name\":\"vid-21b\",\"value\":\"Todavía no llego. \"}]'),
(2, 1, 16121581, '[{\"name\":\"vid-6a\",\"value\":\"nada\"},{\"name\":\"vid-12a\",\"value\":\"termine la primaria\"},{\"name\":\"vid-15a\",\"value\":\"termine la secundaria\"},{\"name\":\"vid-18a\",\"value\":\"cursando la universida\"},{\"name\":\"vid-21a\",\"value\":\"apenas tengo 18\"},{\"name\":\"vid-6b\",\"value\":\"nada\"},{\"name\":\"vid-12b\",\"value\":\"nada\"},{\"name\":\"vid-15b\",\"value\":\"nada\"},{\"name\":\"vid-18b\",\"value\":\"ser una persona cero ejemplar\"},{\"name\":\"vid-21b\",\"value\":\"apenas tengo 18\"}]'),
(2, 1, 16121583, '[{\"name\":\"vid-6a\",\"value\":\"GANAR UN CONCURSO DE TEATRO, SER LA ABANDERADA EN ESCOLTA, SALIR EN MUCHOS EVENTOS ARTÍSTICOS, LLEVAR BUENAS CALIFICACIONES, GRADUARME DEL KINDER\"},{\"name\":\"vid-12a\",\"value\":\"ESTAR EN LA ESCOLTA, SER DE LOS PROMEDIOS MÁS ALTOS EN LA ESCUELA, GRADUARME DE LA PRIMARIA, PARTICIPAR EN MUCHAS ACTIVIDADES DEPORTIVAS\"},{\"name\":\"vid-15a\",\"value\":\"APRENDER A BAILAR JAZZ, SALSA, CUMBIA, BACHATA. ENTRAR A UN GRUPO DE TANGO Y TENER VARIAS PRESENTACIONES FRENTE A BAILARINES INTERNACIONALES,\r\nMANTENER UN BUEN PROMEDIO, PERTENECER A LA ESCOLTA DE LA ESCUELA, GRADUARME DE LA SECUNDARIA, \"},{\"name\":\"vid-18a\",\"value\":\"GRADUARME DE LA PREPA, OBTENER MÁS CONFIANZA EN MI MISMA, ENTRAR AL INSTITUTO TECNOLÓGICO DE MORELIA, ENTRAR AL EQUIPO DE VOLEY, SEGUIR CON EL BAILE, HACERME MÁS INDEPENDIENTE Y RELACIONARME MEJOR CON LAS PERSONAS\"},{\"name\":\"vid-21a\",\"value\":\"AÚN NO LOS CUMPLO\"},{\"name\":\"vid-6b\",\"value\":\"NO CONSEGUIR UN PAPEL EN UNA OBRA QUE QUERÍA, ME DISTRAÍA MUY FACILMENTE\"},{\"name\":\"vid-12b\",\"value\":\"LESIÓN EN EL TOBILLO, FALTA DE CONFIANZA EN MIS CAPACIDADES, INSEGURIDADES AL REALIZAR COSAS \"},{\"name\":\"vid-15b\",\"value\":\"ME COSTABA UN POCO RELACIONARME CON LAS PERSONAS, ERA ALGO INTROVERTIDA, \"},{\"name\":\"vid-18b\",\"value\":\"NO CONSIDERO QUE HAYA TENIDO FRACASOS AÚN, PERO SE QUE AÚN HAY MAS POTENCIAL QUE PUEDO SACAR Y MÁS HABILIDADES QUE PUEDO DESCUBRIR\"},{\"name\":\"vid-21b\",\"value\":\"AÚN NO LOS CUMPLO\"}]'),
(2, 1, 16121585, '[{\"name\":\"vid-6a\",\"value\":\"No recuerdo\"},{\"name\":\"vid-12a\",\"value\":\"Sali de la primaria\"},{\"name\":\"vid-15a\",\"value\":\"sali de la secundaria\"},{\"name\":\"vid-18a\",\"value\":\"sali de la prepa\"},{\"name\":\"vid-21a\",\"value\":\"aun no los tengo\"},{\"name\":\"vid-6b\",\"value\":\"No recuerdo\"},{\"name\":\"vid-12b\",\"value\":\"ninguno\"},{\"name\":\"vid-15b\",\"value\":\"ningno\"},{\"name\":\"vid-18b\",\"value\":\"ninguno\"},{\"name\":\"vid-21b\",\"value\":\"Aun no los tengo\"}]'),
(2, 1, 16121587, '[{\"name\":\"vid-6a\",\"value\":\"Entrar a la primaria\r\nAprender a leer\r\nAprender a escribir\r\nObtener un premio por ganar un concurso de dibujo de equidad de géneros\"},{\"name\":\"vid-12a\",\"value\":\"Salir de la primaria\r\nEntrar a la secundaria \r\nObtener un lugar en el cuadro de honor\r\nHacer muchas amistades\"},{\"name\":\"vid-15a\",\"value\":\"Salir de la secundaria \r\nEntrar a la preparatoria\r\nNuevamente obtener buenas calificaciones\r\nAprender a bailar\r\nSuperarme y ponerme en un peso adecuado\"},{\"name\":\"vid-18a\",\"value\":\"Salir de la preparatoria\r\nEntrar a la universidad\r\nLograr entrar a la carrera que quería\r\nAprender a bailar ritmos latinos en pareja\r\nTener buen promedio\"},{\"name\":\"vid-21a\",\"value\":\"Todavía no cumplo\"},{\"name\":\"vid-6b\",\"value\":\"Muy pesado tratar de aprender otro idioma (inglés)\"},{\"name\":\"vid-12b\",\"value\":\"Esfuerzo muy grande para sacar buenas calificaciones\"},{\"name\":\"vid-15b\",\"value\":\"Esfuerzo para poder ponerme en forma y en un peso adecuado\r\nEnemistades con compañeras en la escuela\"},{\"name\":\"vid-18b\",\"value\":\"Esfuerzo para presentar el examen de ingreso a la universidad\r\n\"},{\"name\":\"vid-21b\",\"value\":\"Todavía no cumplo\"}]'),
(2, 1, 16121590, '[{\"name\":\"vid-6a\",\"value\":\"Aprendí a Leer y a escribir.\r\nDije mi primera poesía.\r\nAprendí a andar en bicicleta.\r\nObtuve mi primer diploma.\"},{\"name\":\"vid-12a\",\"value\":\"Era la más sobresaliente de mi clase académicamente.\r\nEra buena bailando.\r\nCada vez desarrolla más la habilidad de declamar.\"},{\"name\":\"vid-15a\",\"value\":\"Aprendí a Montar a caballo.\r\nLogre ir encuentros académicos importantes.\r\nAprendí a ser independiente y autosuficiente.\r\nConseguí mi primer trabajo.\r\nDeje de ser sumisa.\"},{\"name\":\"vid-18a\",\"value\":\"Logre entrar al Tecnológico de  Morelia y ser un Pony.\r\nLogre ayudar a mi papá a salir de su vicio y arreglar las cosas con el, fortaleciendo nuestros lazos afectivos y volviéndonos muy unidos\"},{\"name\":\"vid-21a\",\"value\":\"Todavía  no llegó a esa edad.\"},{\"name\":\"vid-6b\",\"value\":\"Le tenia miedo mi papá porque este era alcohólico y ademas era muy agresivo.\r\nM mamá casi no estaba conmigo porque estudiaba y trabajaba.\r\n\"},{\"name\":\"vid-12b\",\"value\":\"A mi mamá le diagnosticaron Cáncer.\r\nNo tenía amigos, nadie me hablaba, era muy solitaria.\r\nMe deprimia con frecuencia.\r\nNo tenía una estabilidad familiar, pues andaba de casa en casa porque mis papás se la pasaban en el hospital.\r\n\"},{\"name\":\"vid-15b\",\"value\":\"Mi mamá falleció.\r\nEl alcoholismo de mi papá se volvió mas fuerte, además de que se volvió mucho más agresivo. Dejó de hacerse responsable de mi, es decir no me daba dinero ni para comer, ni para ir a la escuela.\r\nNo tenía el apoyo de mi familia.\"},{\"name\":\"vid-18b\",\"value\":\"Estoy estudiando algo que no quiero.\r\nNo estamos bien económicamente.\r\n \"},{\"name\":\"vid-21b\",\"value\":\"Todavía no llegó a esa edad.\"}]'),
(2, 1, 16121592, '[{\"name\":\"vid-6a\",\"value\":\"A los 6 años entré a la escuela primaria y llevaba buenas calificaciones, también pude mejorar poco mi timidez. Recuerdo que cuando entre no sabía leer y la mayoría de mis compañeros de clase sí, entonces eso me impulso para aprender y al terminar el curso era de las que mejor leía.\"},{\"name\":\"vid-12a\",\"value\":\"A los 12 años estaba en el último año de la primaria y pude aprender tanto en esos 6 años, estaba feliz por las grandes amistades que tenía y que al día de hoy siguen siendo de mis mejores amigas, en quinto año de primaria gané un reconocimiento por ser la alumna de mayor aprovechamiento y eso me hizo creer más en mi misma.\"},{\"name\":\"vid-15a\",\"value\":\"A los 15 años apenas terminé la secundaria y mis logros hasta ese momento eran que llevaba buenas calificaciones y nunca me había llevado ninguna al extra. Había crecido mucho como persona y tenía más confianza, salía con mis amigas y tenía metas por cumplir una de ellas era entrar a la preparatoria, al CETIS 120.\"},{\"name\":\"vid-18a\",\"value\":\"A los 18 años me dieron una noticia que cambio mi vida; había sido aceptada en el Tecnológico de Morelia. Fue increíble poder pasar el examen de admisión y por supuesto haber terminado la preparatoria, también en la preparatoria el día de la clausura me dieron un reconocimiento por haber sido la de mejor promedio en mi grupo, ni yo me la creía pero valió la pena todos mis esfuerzos y mi perseverancia. \"},{\"name\":\"vid-21a\",\"value\":\"Aún no tengo 21 años.\"},{\"name\":\"vid-6b\",\"value\":\"Era muy tímida e insegura y me daba miedo llegar a una escuela que no conocía pues a los 6 años me mude de casa y por ende de escuela, también mis padres se separaron y mi mamá comenzó a trabajar así que ya no la veía como antes.\"},{\"name\":\"vid-12b\",\"value\":\"Tenía miedo de entrar a la secundaria me daba muchos nervios pensar hacía cual escuela elegir, tenía miedo de separarme de mis amigas y de no ser capaz de entrar a una buena escuela.\"},{\"name\":\"vid-15b\",\"value\":\"En esa edad me volví un poco descuidada en la escuela pues me gustaba salir y no preocuparme tanto pero sólo fue un tiempo relativamente corto y nunca descuide al punto de salir mal en la secundaria. En ese momento tenía que tomar una decisión muy importante, elegir la preparatoria y siempre me causan un poco de miedo y emoción los cambios.\r\nMis miedos eran separarme de mi mamá pues ya cuando entré a la prepa comencé a vivir con mi abuela paterna y era un gran cambio para mi.\"},{\"name\":\"vid-18b\",\"value\":\"Mis debilidades al entrar a la universidad han sido contabilidad pues jamas había tenido alguna clase de esta materia, entre sin siquiera conocer lo que es activo y pasivo y me aterraba pensar que tal vez no podía lograr pasar esta materia, pero hasta el momento he estudiado y tomado notas, preguntado y también he ido a asesorías, espero me vaya bien y así como en esta materia, me esfuerzo en todas la materias.\"},{\"name\":\"vid-21b\",\"value\":\"Aún no tengo 21 años.\"}]'),
(2, 1, 16121593, '[{\"name\":\"vid-6a\",\"value\":\"Aprender a caminar,hablar, entrar al kinder \"},{\"name\":\"vid-12a\",\"value\":\"Terminar la primaria con buen promedio \r\nIniciar la secundaria \"},{\"name\":\"vid-15a\",\"value\":\"Ser un estudiante destacado en mi salón de clases\"},{\"name\":\"vid-18a\",\"value\":\"Terminar la preparatoria con buen promedio.\r\nObtener mi título técnico automático por las buenas calificaciones.\r\nIngresar al Instituto Tecnológico de Morelia \"},{\"name\":\"vid-21a\",\"value\":\"NA\"},{\"name\":\"vid-6b\",\"value\":\"dificultades para aprender a escribir\"},{\"name\":\"vid-12b\",\"value\":\"Problemas para socializar en la secundaria \"},{\"name\":\"vid-15b\",\"value\":\"Problemas típicos de la adolescencia \"},{\"name\":\"vid-18b\",\"value\":\"Frustraciones por no poder hacer todo lo que quiero\"},{\"name\":\"vid-21b\",\"value\":\"NA\"}]'),
(2, 1, 16121595, '[{\"name\":\"vid-6a\",\"value\":\"Logré entrar a la primaria y salir con buenas notas del kinder.\"},{\"name\":\"vid-12a\",\"value\":\"entre a la secundaria y salí con un buen promedio de la primaria\"},{\"name\":\"vid-15a\",\"value\":\"entre a la preparatoria \"},{\"name\":\"vid-18a\",\"value\":\"entre al tecnológico de morelia y mejoro mi autoconfianza\"},{\"name\":\"vid-21a\",\"value\":\"todavía no los cumplo\"},{\"name\":\"vid-6b\",\"value\":\"Poca confianza en mi misma y me costaba trabajo encajar en la escuela\"},{\"name\":\"vid-12b\",\"value\":\"me costaba trabajo encajar en la escuela y seguía teniendo poca confianza\"},{\"name\":\"vid-15b\",\"value\":\"baje calificaciones por tratar de encajar en la escuela, pero seguia sin encajar, no me sentia agusto\"},{\"name\":\"vid-18b\",\"value\":\"creo que no tengo limitaciones más que mi autoconfianza\"},{\"name\":\"vid-21b\",\"value\":\"todavía no los cumplo\"}]'),
(2, 1, 16121597, '[{\"name\":\"vid-6a\",\"value\":\"acabar el kinder\"},{\"name\":\"vid-12a\",\"value\":\"acabar la primaria, ganar un mini torneo de Ajedrez\r\n\r\n\r\n\r\n\"},{\"name\":\"vid-15a\",\"value\":\"acabar la secundaria\"},{\"name\":\"vid-18a\",\"value\":\"acabar la prepa\"},{\"name\":\"vid-21a\",\"value\":\"-\"},{\"name\":\"vid-6b\",\"value\":\"no recuerdo\"},{\"name\":\"vid-12b\",\"value\":\"no recuerdo\"},{\"name\":\"vid-15b\",\"value\":\"no tuve\"},{\"name\":\"vid-18b\",\"value\":\"no tengo\"},{\"name\":\"vid-21b\",\"value\":\"-\"}]'),
(2, 1, 16121598, '[{\"name\":\"vid-6a\",\"value\":\"ENTRÉ A CURSAR LA PRIMARIA\"},{\"name\":\"vid-12a\",\"value\":\"LOGRÉ SALIR DE LA PRIMARIA CON UNO DE LOS MEJORES PROMEDIOS, FUI MUY QUERIDA POR MIS MAESTROS, Y LOGRÉ QUEDAR EN LA SECUNDARA\"},{\"name\":\"vid-15a\",\"value\":\"TERMINÉ LA SECUNDARIA, LOGRÉ ESTAR EN EL CUADRO DE HONOR, Y TAMBIÉN LOGRÉ ENTRAR A LA UNIVERSIDAD LA SALLE\"},{\"name\":\"vid-18a\",\"value\":\"GRADUARME DE LA PREPA, ENTRAR AL ITM Y LOGRAR QUEDAR EN NIVEL NORMAL EN VEZ DE 0\"},{\"name\":\"vid-21a\",\"value\":\"TERMINAR MI CARRERA PARA ESE ENTONCES VIVIR SOLA, SER INDEPENDIENTE TOTAL MENTE\"},{\"name\":\"vid-6b\",\"value\":\"TENÍA MIEDO DE LO NUEVO\"},{\"name\":\"vid-12b\",\"value\":\"TENÍA QUE HACER EL EXAMEN PARA LA SECUNDARIA Y TENÍA MUCHO MIEDO DE NO QUEDAR\"},{\"name\":\"vid-15b\",\"value\":\"NO\"},{\"name\":\"vid-18b\",\"value\":\"PRIMERO HABER QUEDADO EN 0 ANTES DE HABER SIDO LLAMADA A SEMESTRE NORMAL\"},{\"name\":\"vid-21b\",\"value\":\"NO CONSEGUIR FÁCILMENTE UN TRABAJO\"}]'),
(2, 1, 16121602, '[{\"name\":\"vid-6a\",\"value\":\"Salir del kinder \"},{\"name\":\"vid-12a\",\"value\":\"Graduarme con excelentes calificaciones de la primaria e ingresar a la secundaria; conseguir diplomas; estudiar un año fuera del país.\"},{\"name\":\"vid-15a\",\"value\":\"Salir con excelente promedio de la secundaria e ingresar a una muy padre preparatoria; salir a estudiar prácticamente sólo a una ciudad nueva; salir de mi zona de confort y expandir mi aprendizaje \"},{\"name\":\"vid-18a\",\"value\":\"Ingresar a la universidad; salir de la preparatoria con nuevos conocimientos y visiones acerca de la vida; lograr excelentes promedios en la preparatoria\"},{\"name\":\"vid-21a\",\"value\":\"Próximamente\"},{\"name\":\"vid-6b\",\"value\":\"Creo a esa edad no tenia obstáculos porque aun decidían por mi\"},{\"name\":\"vid-12b\",\"value\":\"No poder seguir estudiando fuera y regresar a México\"},{\"name\":\"vid-15b\",\"value\":\"Hacer mi primer y único extraordinario; \"},{\"name\":\"vid-18b\",\"value\":\"No poder salir a una nueva ciudad a estudiar; no seguir en la misma Universidad en la que me encontraba; no salir de mi zona de confort\"},{\"name\":\"vid-21b\",\"value\":\"Ninguno por el momento\"}]'),
(2, 1, 16121606, '[{\"name\":\"vid-6a\",\"value\":\"Termine mi educación preescolar\r\nAprendí a leer\r\n\"},{\"name\":\"vid-12a\",\"value\":\"Termine la primaria\r\nAprendí a sumar, restar, multiplicar y dividir\r\nAprendí a andar en bici\r\nDesarrolle una mentalidad matematica\r\n\"},{\"name\":\"vid-15a\",\"value\":\"Termine mi secundaria\r\nParticipe en un equipo de Basquet\r\nTambien de futbol\r\nCompetí en atletismo y gané el primer lugar en 100 mts planos y el tercer lugar en 1500 mts\r\nMejore mi temperamento\"},{\"name\":\"vid-18a\",\"value\":\"Termine mi preparatoria\r\nAprendi a ser mas independiente\r\nA tener mas educación para la escuela\r\nSer más social\r\n\"},{\"name\":\"vid-21a\",\"value\":\"Termine otro bachillerato\r\nConseguí mi primer trabajo\r\nIngresé al Tecnológico\r\n\"},{\"name\":\"vid-6b\",\"value\":\"Ser latoso\r\nLA separacion de mis padres\"},{\"name\":\"vid-12b\",\"value\":\"Era muy violento\r\nMe la pasaba en la calle\"},{\"name\":\"vid-15b\",\"value\":\"Me fracture\r\nMe corrieron de la escuela pero ingresé inmediatamente a otra\"},{\"name\":\"vid-18b\",\"value\":\"Me salí de Fismat\r\nMe cuesta trabajo leer\r\n\"},{\"name\":\"vid-21b\",\"value\":\"Sigue costando-me trabajo leer \"}]'),
(2, 1, 16121607, '[{\"name\":\"vid-6a\",\"value\":\"Aprender a convivir con mas personas y a relacionarte con los demás, además es la etapa donde entras a la escuela y eso es algo nuevo.\r\ndentro de esta etapa ya se sabe un poco leer y escribir, además de que empiezas a utilizar los números.\"},{\"name\":\"vid-12a\",\"value\":\"a esta edad normalmente concluimos la primaria y ese es uno de los logros principales que tenemos haber terminado la primaria con buenas calificaciones. \"},{\"name\":\"vid-15a\",\"value\":\"uno de los logros fue terminar la secundaria, tener más amigos, además de adquirir más conocimiento.\"},{\"name\":\"vid-18a\",\"value\":\"terminar la preparatoria con un buen promedio, \"},{\"name\":\"vid-21a\",\"value\":\"haber tenido mi primer trabajo.\"},{\"name\":\"vid-6b\",\"value\":\"algunos de los que se decían tus amigos ahora no lo son, pero eso no fue de mucha importancia por que conoces con el tiempo a más personas.\"},{\"name\":\"vid-12b\",\"value\":\"en esta etapa no considero haber tenido fracasos puesto que todo era un aprendizaje.  \"},{\"name\":\"vid-15b\",\"value\":\"una de las limitaciones fue que quizás la primaria donde había estudiado en cuanto informática me faltaron conocimientos pero ya en la secundaria fue un poco más lento puesto que ellos ya tenían ciertos conocimientos y por lo tanto para mi era un poco más difícil..\"},{\"name\":\"vid-18b\",\"value\":\"en esta etapa no los considera fracasos, todas fueron buenas experiencias de las cuales se aprende.\"},{\"name\":\"vid-21b\",\"value\":\"no tener los recursos para poder seguir estudiando.\"}]'),
(2, 1, 16121608, '[{\"name\":\"vid-6a\",\"value\":\"Terminar preescolar\"},{\"name\":\"vid-12a\",\"value\":\"Terminar Primaria\r\n\"},{\"name\":\"vid-15a\",\"value\":\"Terminar Secundaria\"},{\"name\":\"vid-18a\",\"value\":\"Terminar la Preparatoria\"},{\"name\":\"vid-21a\",\"value\":\"Estar estudiando en el Instituto tecnologico de morelia\"},{\"name\":\"vid-6b\",\"value\":\"ninguno\"},{\"name\":\"vid-12b\",\"value\":\"ninguno\"},{\"name\":\"vid-15b\",\"value\":\"ninguno\"},{\"name\":\"vid-18b\",\"value\":\"ninguno\"},{\"name\":\"vid-21b\",\"value\":\"ninguno\"}]'),
(2, 1, 16121611, '[{\"name\":\"vid-6a\",\"value\":\"Poder leer frente a mis compañeros\"},{\"name\":\"vid-12a\",\"value\":\"Poder estar en la escolta sin miedo a equivocarme\"},{\"name\":\"vid-15a\",\"value\":\"Pasar todas mis materias\"},{\"name\":\"vid-18a\",\"value\":\"Terminar el ultimo semestre sin semestrales\"},{\"name\":\"vid-21a\",\"value\":\"Aun no llego\"},{\"name\":\"vid-6b\",\"value\":\"No recuerdo\"},{\"name\":\"vid-12b\",\"value\":\"Bajar mis calificaciones en sexto\"},{\"name\":\"vid-15b\",\"value\":\"No comprender geografía\"},{\"name\":\"vid-18b\",\"value\":\"Tener promedio bajo\"},{\"name\":\"vid-21b\",\"value\":\"Aun no llego\"}]'),
(2, 1, 16121612, '[{\"name\":\"vid-6a\",\"value\":\"Ser un chico constante y responsable.\"},{\"name\":\"vid-12a\",\"value\":\"Ser representante de grupo.\"},{\"name\":\"vid-15a\",\"value\":\"Terminar mi secundaria con promedio de 9.7\r\nSer presidente estudiantil de todo el plantel.\r\nAcreedor a una beca del 50% por parte de TecMilenio del sistema Tecnológico de Monterrey.\"},{\"name\":\"vid-18a\",\"value\":\"Acreedor a una beca del 50% en la universidad EBC (Escuela Bancaria y Comercio) en León, Guanajuato.\r\nIngresar a Club Toastmasters Internacional\r\nConseguir un lugar en el Instituto Tecnológico de Morelia.\r\nReforestar y cuidar el medio ambiente.\r\nColaborar en un proyecto emprendedor de alto impacto Negociandola.\r\nSer padrino de presentación de Santiago Hernández.\r\nCrear un modelo de enseñanza  y trabajar mi paciencia con mis hermanos los fines de semana.\r\nFormar parte de un grupo cultural de debate.\r\n\"},{\"name\":\"vid-21a\",\"value\":\"Esperemos llegar hasta allá.\"},{\"name\":\"vid-6b\",\"value\":\"Ser una persona apática y muy egoísta.\"},{\"name\":\"vid-12b\",\"value\":\"Menospreciar y atacar los demás.\"},{\"name\":\"vid-15b\",\"value\":\"Faltas de respeto a mis superiores.\"},{\"name\":\"vid-18b\",\"value\":\"No reconocer mis virtudes y habilidades.\"},{\"name\":\"vid-21b\",\"value\":\"Esperemos llegar hasta allá.\"}]'),
(2, 1, 16121615, '[{\"name\":\"vid-6a\",\"value\":\"Enfrentar algunas situaciones difíciles por las que pasaba.\"},{\"name\":\"vid-12a\",\"value\":\"Descubrí una nueva parte de mi que había reprimido mucho tiempo y me liberé de muchas cosas.\"},{\"name\":\"vid-15a\",\"value\":\"Le di un nuevo giro a mi vida con experiencias nuevas. Ordené muchas cosas en ella que estaban en desorden e inicie mi preparatoria con mi carrera técnica :)\"},{\"name\":\"vid-18a\",\"value\":\"Concluí mi carrera técnica en Puericultura :D\r\nFue un logro muy importante y significativo para mi.\r\nAdemás de que me titulé por promedio \r\ny en mi servicio social y prácticas profesionales aprendí mucho. Fueron bellas y provechosas experiencias. \"},{\"name\":\"vid-21a\",\"value\":\"He tenido muchísimos logros y experiencias bellas en los últimos años de mi vida. He crecido mucho como persona he tenido grandes y buenos éxitos en mi vida profesional, laboral, familiar y personal.\"},{\"name\":\"vid-6b\",\"value\":\"Pasé por situaciones emocionales difíciles a nivel personal debido a problemas escolares.\"},{\"name\":\"vid-12b\",\"value\":\"Atravesé por muchos cambios en varios aspectos, además de problemas familiares que había en mi casa.\"},{\"name\":\"vid-15b\",\"value\":\"Tuve muchos problemas con mis papas, sobretodo con mi papá, y se me generó muchas dificulades personales, emocionales y familiares.\"},{\"name\":\"vid-18b\",\"value\":\"Presenté mi exámen para entrar a la facultad de medicina y lo aprobé pero no quedé dentro de los 500 lugares que dan solamente.\"},{\"name\":\"vid-21b\",\"value\":\"También han sido años de grandes retos y dificultades que me costaron muchos sacrificios y dolor sobretodo personal y familiarmente.\"}]'),
(2, 1, 16121616, '[{\"name\":\"vid-6a\",\"value\":\"Cursaba el primer año de primaria y aprendí a leer y a relacionarme bien con mis compañeros.\"},{\"name\":\"vid-12a\",\"value\":\"Me encontraba cursando mi primer año en la educación secundaria y me sentía muy seguro de los conocimientos que había adquirido en la primaria.\"},{\"name\":\"vid-15a\",\"value\":\"En esta edad acababa de terminar la educación secundaria y me sentía muy feliz por haber terminado exitosa y satisfactoriamente, aun después de que todo el periodo de clases tuve la oportunidad de trabajar.\"},{\"name\":\"vid-18a\",\"value\":\"En esta edad concluir mis estudios en el bachillerato y me sentía muy feliz y motivado a lograr todas mis metas y aspiraciones.\"},{\"name\":\"vid-21a\",\"value\":\"No he llegado a esa edad.\"},{\"name\":\"vid-6b\",\"value\":\"en esta edad me paso un accidente el el brazo izquierdo (fractura) que me limito a hacer muchas cosas.\"},{\"name\":\"vid-12b\",\"value\":\"Nuevamente sufrí una fractura que me impidió a realizar algunas actividades físicas.\"},{\"name\":\"vid-15b\",\"value\":\"Descuide un poco mis actividades escolares en el bachillerato y las consecuencias fueron perder un año escolar.\"},{\"name\":\"vid-18b\",\"value\":\"En esta edad me encontraba trabajando en un restaurante de comida rápida, sin embargo fue una muy mala experiencia que no me gustaría que se repitiera por el mal trato que recibía por parte de mis compañeros y jefes.\"},{\"name\":\"vid-21b\",\"value\":\"No eh llegado a esa edad.\"}]'),
(2, 1, 16121617, '[{\"name\":\"vid-6a\",\"value\":\"Termine el preescolar\r\nComencé mis estudios de primaria \"},{\"name\":\"vid-12a\",\"value\":\"Termine la primaria\r\nObtuve diplomas de primer lugar en los 6 años\r\nCompetí en la Olimpiada del Conocimiento Infantil\r\nQuede en cuarto lugar en la Olimpiada del Conocimiento Infantil\r\nEntre al concurso de cuentos\r\nQuede en segundo lugar en el concurso de cuentos\r\nComencé mis estudios en la secundaria\"},{\"name\":\"vid-15a\",\"value\":\"Termine mis estudios en la secundaria\r\nFui a varios concursos de escolta\r\nGanamos el segundo lugar en la escolta\r\nObtuve diploma de primer lugar en los tres años de la secundaria\r\nParticipe en el concurso de Himno Nacional\r\nEntre a la Preparatoria\"},{\"name\":\"vid-18a\",\"value\":\"Termine mis estudios en una escuela de ingles con 9 niveles\r\nTermine mis estudios en la preparatoria\r\nObtuve el primer lugar en mi carrera técnica\r\nMe titule por promedio como Secretaria Ejecutiva Bilingüe\r\nEntre a la Universidad\r\nPasé con buen promedio mi primer semestre en la universidad\r\n\"},{\"name\":\"vid-21a\",\"value\":\"aun no tengo 21\"},{\"name\":\"vid-6b\",\"value\":\"Ninguno que yo recuerde\"},{\"name\":\"vid-12b\",\"value\":\"Falta de confianza en mi misma\"},{\"name\":\"vid-15b\",\"value\":\"Ninguno\"},{\"name\":\"vid-18b\",\"value\":\"ninguna\"},{\"name\":\"vid-21b\",\"value\":\"ninguna\"}]'),
(2, 1, 16121620, '[{\"name\":\"vid-6a\",\"value\":\"entrar en la primaria \"},{\"name\":\"vid-12a\",\"value\":\"Estar en la escolta \r\nrecibir reconocimiento de primer lugar en la primaria \"},{\"name\":\"vid-15a\",\"value\":\"entrar en la prepa \r\nconocer buenos amigos \"},{\"name\":\"vid-18a\",\"value\":\"Entrar en el Tec \"},{\"name\":\"vid-21a\",\"value\":\"X\"},{\"name\":\"vid-6b\",\"value\":\"no aprender a andar en bicicleta \"},{\"name\":\"vid-12b\",\"value\":\"quedar en el turno de la tarde \"},{\"name\":\"vid-15b\",\"value\":\"llevarme a extra por primera vez \"},{\"name\":\"vid-18b\",\"value\":\"siento como una limitación el adaptarme a los cambios \"},{\"name\":\"vid-21b\",\"value\":\"X\"}]'),
(2, 1, 16121622, '[{\"name\":\"vid-6a\",\"value\":\"TERMINAR PREESCOLAR EH INGRESAR A PRIMARIA\"},{\"name\":\"vid-12a\",\"value\":\"SACAR BUENAS NOTAS Y FORMAR PARTE DE LA ESCOLTA EN LA PRIMARIA\"},{\"name\":\"vid-15a\",\"value\":\"DESTACAR EN LA PREPARATORIA\"},{\"name\":\"vid-18a\",\"value\":\"TERMINAR PREPARATORIA EH INGRESAR A LA UNIVERDIDAD\"},{\"name\":\"vid-21a\",\"value\":\"NINGUNO\"},{\"name\":\"vid-6b\",\"value\":\"NINGUMO\"},{\"name\":\"vid-12b\",\"value\":\"NINGUNO\"},{\"name\":\"vid-15b\",\"value\":\"NINGUNO\"},{\"name\":\"vid-18b\",\"value\":\"NINGUNO\"},{\"name\":\"vid-21b\",\"value\":\"NINGUNO\"}]'),
(2, 1, 16121623, '[{\"name\":\"vid-6a\",\"value\":\"-obtuve un diploma por ser la mejor lectora del salón.\r\n\"},{\"name\":\"vid-12a\",\"value\":\"-participe en una carrera atletica\r\n-forme parte de un grupo de la iglesia\r\n-obtuve el tercer lugar en los mejores promedios del salón.\"},{\"name\":\"vid-15a\",\"value\":\"-ya empezaba a salir sola con mis amigos.\r\n-apoyaba a mis amigos en sus problemas.\"},{\"name\":\"vid-18a\",\"value\":\"-entre a la prepa que queria\r\n-forme amistades muy bonitas\r\n- arregle las cosas con mis papas y trate de cambiar\r\n-me enamore de una persona muy bonita en mi vida hasta hoy.\r\n-logre vivir 6 meses en estados unidos.\"},{\"name\":\"vid-21a\",\"value\":\"aún no sé\"},{\"name\":\"vid-6b\",\"value\":\"-me regañaban mucho\r\n\"},{\"name\":\"vid-12b\",\"value\":\"-me cambie de casa\r\n-no quedé en la secuendaria que quería.\r\n\"},{\"name\":\"vid-15b\",\"value\":\"-primera vez que me romperon el corazón\r\nla relación con mis papas se distanció un poco.\"},{\"name\":\"vid-18b\",\"value\":\"-primera vez que me lleve un extra\r\n-a veces le daba más prioridad al desmadre.\"},{\"name\":\"vid-21b\",\"value\":\"aún no sé\"}]'),
(2, 1, 16121628, '[{\"name\":\"vid-6a\",\"value\":\"terminar el kinder y entrar a la primaria\r\naprendi a jugar futbol bien\"},{\"name\":\"vid-12a\",\"value\":\"termine la primaria, entre a la secundaria con ganas de estudiar\"},{\"name\":\"vid-15a\",\"value\":\"termine la secundaria y entre la prepa.\r\nempece a ser mas independiente en tanto a la escuela\"},{\"name\":\"vid-18a\",\"value\":\"termine la preparatoria bien, fui de los mas chicos en salir de la prepa.\"},{\"name\":\"vid-21a\",\"value\":\"se lo que quiero y hacia donde voy, me agrada mi nueva carrera, me encamina hacia donde quiero llegar.\"},{\"name\":\"vid-6b\",\"value\":\"era muy chico de tamaño\"},{\"name\":\"vid-12b\",\"value\":\"me fracture un brazo, esto me impidio hacer muchas cosas en ese tiempo.\r\ndeje de jugar futbol por un tiempo\"},{\"name\":\"vid-15b\",\"value\":\"mis padres se separaron, fue una etapa dificil\"},{\"name\":\"vid-18b\",\"value\":\"no encontraba bien en ese entonces que era lo que me gustaba para poder dedicarme a ello, asi que estudie en la universidad una ingenieria\"},{\"name\":\"vid-21b\",\"value\":\"mis limitaciones pueden ser el tiempo para trabajar y estudar y asi satisfacer mis gustos y necesidades.\"}]'),
(2, 1, 16121629, '[{\"name\":\"vid-6a\",\"value\":\"El kinder \r\n\"},{\"name\":\"vid-12a\",\"value\":\"Dejar la Timides\r\nDiplomas por promedios\r\nB\r\nSalir en bailables y terminar la primaria\"},{\"name\":\"vid-15a\",\"value\":\"Terminar la secundaria\"},{\"name\":\"vid-18a\",\"value\":\"Entrar al tec\r\nConocer y hacer amigos nuevos\"},{\"name\":\"vid-21a\",\"value\":\"Aún no\"},{\"name\":\"vid-6b\",\"value\":\"Timides, no tenia amigos \"},{\"name\":\"vid-12b\",\"value\":\"Cambios físicos y psicológicos\"},{\"name\":\"vid-15b\",\"value\":\"Volví a ser timida\"},{\"name\":\"vid-18b\",\"value\":\"La inseguridad de quien soy y mi carrera elegida\"},{\"name\":\"vid-21b\",\"value\":\"Aún no \"}]'),
(2, 1, 16121635, '[{\"name\":\"vid-6a\",\"value\":\"supe andar en bicicleta, entre a la primaria, Tenía dos hermanos.\"},{\"name\":\"vid-12a\",\"value\":\"entre a un curso de computación, tenía muchos amigos, tenía ya a mis tres hermanos. Estaba en la escolta oficial de la primaria.\"},{\"name\":\"vid-15a\",\"value\":\"estaba en la escolta oficial de la secundaria, tenía uno de los mejores promedios y conocí a muchas personas.\"},{\"name\":\"vid-18a\",\"value\":\"estuve en la escolta oficial, salí de bachilleres con buen promedio, logré entrar a la universidad\"},{\"name\":\"vid-21a\",\"value\":\"aun no tengo\"},{\"name\":\"vid-6b\",\"value\":\"me quitaron los dulces, refrescos y todas las chucherías, por tener anemia\"},{\"name\":\"vid-12b\",\"value\":\"ya no tenía a mis dos abuelos, mi abuela materna, mi abuelo paterno.\"},{\"name\":\"vid-15b\",\"value\":\"mis padres me limitaban, empece a usar lentes, y tuve una operación.\"},{\"name\":\"vid-18b\",\"value\":\"fallece mi abuelo materno.\"},{\"name\":\"vid-21b\",\"value\":\"aun no tengo\"}]'),
(2, 1, 16121676, '[{\"name\":\"vid-6a\",\"value\":\"Leer\"},{\"name\":\"vid-12a\",\"value\":\"jugar videojuegos\"},{\"name\":\"vid-15a\",\"value\":\"jugar profesionalmente videojuegos\"},{\"name\":\"vid-18a\",\"value\":\"Entrara a una banda\"},{\"name\":\"vid-21a\",\"value\":\"No he legado\"},{\"name\":\"vid-6b\",\"value\":\"No saber andar en bici\"},{\"name\":\"vid-12b\",\"value\":\"No recuerdo ninguna\"},{\"name\":\"vid-15b\",\"value\":\"Reporbar materias\"},{\"name\":\"vid-18b\",\"value\":\"No echarle ganas a la escuela\"},{\"name\":\"vid-21b\",\"value\":\"No he llegado\"}]'),
(2, 1, 17120232, '[{\"name\":\"vid-6a\",\"value\":\"Entré a la primaria, obtuve un diploma, aprendí el buen hábito de ahorrar.\"},{\"name\":\"vid-12a\",\"value\":\"Salí de la primaria, entré a la secundaria, mi disciplina en la escuela fue mejorando poco a poco, aprendí a cocinar pocas cosas, manejé por primera vez y tuve mi primera novia. \"},{\"name\":\"vid-15a\",\"value\":\"Salí de la secundaria con buenas calificaciones, aprendí a cocinar más y mejores cosas, mi comportamiento con mis padres mejoró bastante y entré a la preparatoria. \"},{\"name\":\"vid-18a\",\"value\":\"Terminé mi prepa, conseguí una relación estable con mi ahora novia, conseguí empleo por un tiempo, me metí al gimnasio, mejoré mi aspecto físico y aprendí muchas cosas de la vida durante este lapso. \"},{\"name\":\"vid-21a\",\"value\":\"Quiero seguir en la universidad, tener un empleo, mejorar mi físico, ayudar económicamente a mi familia.\"},{\"name\":\"vid-6b\",\"value\":\"Tuve mi primer reporte por indisciplina en la primaria y mis padres me regañaban mucho por malas calificaciones. \"},{\"name\":\"vid-12b\",\"value\":\"Salí de sexto con bajas calificaciones, era indisciplinado y flojo pero ya no tanto como en la primaria, y mis compañeros de secundaria me molestaban mucho. \"},{\"name\":\"vid-15b\",\"value\":\"Tenía un mal aspecto físico, tuve limitaciones en la preparatoria por mi situación económica.\"},{\"name\":\"vid-18b\",\"value\":\"Perdí mi trabajo por ser muy distraído, salí del gimnasio por falta de tiempo, me perdí de muchas cosas por mi situación económica cuando iba en prepa. \"},{\"name\":\"vid-21b\",\"value\":\"Espero y mi situación económica no influya en la universidad.\"}]'),
(2, 1, 17120676, '[{\"name\":\"vid-6a\",\"value\":\"colorear bonito y jugar mucho\"},{\"name\":\"vid-12a\",\"value\":\"salir de la primaria\"},{\"name\":\"vid-15a\",\"value\":\"salir de la secundaria y tener amigos \"},{\"name\":\"vid-18a\",\"value\":\"salir de la preparatoria\"},{\"name\":\"vid-21a\",\"value\":\"seguir estudiando\"},{\"name\":\"vid-6b\",\"value\":\"No ser responsable y hacer enojar a mi mama\"},{\"name\":\"vid-12b\",\"value\":\"tener mal promedio\"},{\"name\":\"vid-15b\",\"value\":\"bajo promedio\"},{\"name\":\"vid-18b\",\"value\":\"quedar en semestre 0\"},{\"name\":\"vid-21b\",\"value\":\"reprobar\"}]'),
