(3, 1, 16121010, '[{\"name\":\"for-1\",\"value\":\"mis mayores talentos están en el deporte y las operaciones matemáticas, puedo hacer desde operaciones básicas hasta operaciones con un nivel de complejidad medio con rapidez, en el deporte tengo trayectoria\"},{\"name\":\"for-2\",\"value\":\"Mi pasión por el deporte y mi constancia entrenando, mi constancia, mi habilidad de no rendirme ante las dificultades y ver el lado positivo de las cosas\"},{\"name\":\"for-3\",\"value\":\"mis activos más valiosos son el estudio y las experiencias compitiendo en natacion, las experiencias con familia y amigos\"},{\"name\":\"for-4\",\"value\":\"-constancia\r\n-eficiencia\r\n-resposabilidad\r\n-humildad\"}]'),
(3, 1, 16121011, '[{\"name\":\"for-1\",\"value\":\"capacidad para aprender rápido, sé trabajar en equipo, buen manejo en la toma de decisiones, atlético y responsable\"},{\"name\":\"for-2\",\"value\":\"ser una persona atlética, capacidad para aprender rápido, responsabilidad y mi buen trabajo en equipo\"},{\"name\":\"for-3\",\"value\":\"mis amigos, la familia y la vida\"},{\"name\":\"for-4\",\"value\":\"responsabilidad, compresión, felicidad y solidaridad\"}]');
