(3, 1, 16121014, '[{\"name\":\"for-1\",\"value\":\"Mis habilidades matemáticas, el razonamiento lógico, la habilidad de decidir bajo presión y la responsabilidad.\"},{\"name\":\"for-2\",\"value\":\"La capacidad de aprendizaje, la inteligencia, la solidaridad.\"},{\"name\":\"for-3\",\"value\":\"El haber conocido a una persona en específico.\r\nMi familia.\r\nMi mascota.\r\nTodas las experiencias que he vivido.\r\n\"},{\"name\":\"for-4\",\"value\":\"Amabilidad\r\nInteligencia\r\nSolidaridad\r\nResponsabilidad\r\n\"}]'),
(3, 1, 16121015, '[{\"name\":\"for-1\",\"value\":\"facilidad con:\r\nCriticas, observaciones precisas y profundas\"},{\"name\":\"for-2\",\"value\":\"no creo que lo hagan...\"},{\"name\":\"for-3\",\"value\":\"no hay\"},{\"name\":\"for-4\",\"value\":\"Creatividad\r\nApertura de mente\r\nPerspectiva\r\nEsperanza\"}]'),
(3, 1, 16121016, '[{\"name\":\"for-1\",\"value\":\"La facilidad en el desarrollo en un área de interés.\"},{\"name\":\"for-2\",\"value\":\"Que soy respetuoso, sencillo. honesto.\"},{\"name\":\"for-3\",\"value\":\"La relación con mi familia.\"},{\"name\":\"for-4\",\"value\":\"Fortalecer aun mas las buenas relaciones.\r\nMantener y aumentas buenos valores.\r\nSeguir desarrollando mis capacidades al máximo.  \r\nSer mas analítico para así hacer los mas conveniente. \r\n\"}]'),
(3, 1, 16121018, '[{\"name\":\"for-1\",\"value\":\"Buena memoria, bueno en matemáticas y ciencias exactas, se programar en distintos lenguajes, se inglés, me gusta aprender.\"},{\"name\":\"for-2\",\"value\":\"Admiran mi facilidad para aprender cosas nuevas e implementarlas\"},{\"name\":\"for-3\",\"value\":\"He hecho muchos cursos de programación, de seguridad informática y hacking.\r\nSe sobre hardware, y sobre electrónica.\"},{\"name\":\"for-4\",\"value\":\"Gusto por aprender\r\nConocimientos Técnicos\r\nHabilidad analítica y matemática\r\nMantenerme activo\"}]'),
(3, 1, 16121023, '[{\"name\":\"for-1\",\"value\":\"bueno para el deporte\r\ninteligente\"},{\"name\":\"for-2\",\"value\":\"capaz de hacer todo lo que me propongo\"},{\"name\":\"for-3\",\"value\":\"que soy sano en cuestion de la alimentacion\"},{\"name\":\"for-4\",\"value\":\"responsabilidad\r\nsalud\r\nmotivacion\r\npositivismo\"}]'),
(3, 1, 16121025, '[{\"name\":\"for-1\",\"value\":\"Rápido aprendizaje. Buen aprovechamiento escolar.\"},{\"name\":\"for-2\",\"value\":\"Mi entusiasmo de estudiar. Mis ganas de superarme y salir adelante.\"},{\"name\":\"for-3\",\"value\":\"La participación en varios concursos y ferias a nivel local, estatal, nacional e internacional, obteniendo buenos resultados.\"},{\"name\":\"for-4\",\"value\":\"Confianza en mí mismo. Responsabilidad. Esfuerzo. Honestidad.\"}]'),
(3, 1, 16121026, '[{\"name\":\"for-1\",\"value\":\"Empatía\r\nPerseverancia\r\nValentía\r\nHumildad\"},{\"name\":\"for-2\",\"value\":\"Mi determinación y mi actitud positiva, mi inteligencia y capacidad para realizar las cosas.\"},{\"name\":\"for-3\",\"value\":\"No los tengo bien definidos.\"},{\"name\":\"for-4\",\"value\":\"Determinación, actitud positiva, humildad y perseverancia.\"}]'),
(3, 1, 16121029, '[{\"name\":\"for-1\",\"value\":\"Mis mejores talentos es jugar basket y ser buen estudiante\"},{\"name\":\"for-2\",\"value\":\"Creo que no podria admirar nada de mi, ya que cambiaria muchas cosas de mi, de mis virtudes es que soy responsable y buen amigo\"},{\"name\":\"for-3\",\"value\":\"Mis mejores experiencias fueron en la prepa ya que ahi descubri muchas cosas \"},{\"name\":\"for-4\",\"value\":\"Responsable\r\nseguro \r\nconfiado \r\nAtento\"}]'),
(3, 1, 16121036, '[{\"name\":\"for-1\",\"value\":\"Soy muy bueno reteniendo información, rara vez tengo que estudiar pues lo retengo fácilmente.\r\nSoy alguien tranquilo nunca me deprime o me enoja algo, lo tomo a la ligera y si se puede hacer algo lo hago.\r\nSoy solidario, siempre que alguien busca mi ayuda, y esta a mi alcance lo haré sin problemas.\"},{\"name\":\"for-2\",\"value\":\"Mi inteligencia\r\nMi sentido del humor\r\nMi creatividad\r\nMi comprension\"},{\"name\":\"for-3\",\"value\":\"Mi familia, mis amigos, mis mascotas, la experiencia universitaria, mis videojuegos.\"},{\"name\":\"for-4\",\"value\":\"Disciplina\r\nSociabilidad\r\nCompromiso\r\nConstancia\"}]'),
(3, 1, 16121041, '[{\"name\":\"for-1\",\"value\":\"Perseverante, entusiasta, dedicado y ambicioso.\"},{\"name\":\"for-2\",\"value\":\"Honesto, entusiasta y activo\"},{\"name\":\"for-3\",\"value\":\"Experiencias de vida deportiva, mis familiares y consejos de vida\"},{\"name\":\"for-4\",\"value\":\"Responsable, atento, inhibido y fluido\"}]'),
(3, 1, 16121043, '[{\"name\":\"for-1\",\"value\":\"Perseverancia, inteligencia, agilidad, optimismo, honestidad, compromiso y dedicación.\"},{\"name\":\"for-2\",\"value\":\"Mi optimismo, mi perseverancia, mi compromiso y mi dedicación.\"},{\"name\":\"for-3\",\"value\":\"Mi familia, mi novia, mis amigos, mi instrumento musical, mi forma de ser.\"},{\"name\":\"for-4\",\"value\":\"Optimismo.\r\nDedicación.\r\nTrabajo en equipo.\r\nPerseverancia.\"}]'),
(3, 1, 16121044, '[{\"name\":\"for-1\",\"value\":\"deportista\r\ninteligente\"},{\"name\":\"for-2\",\"value\":\"que falto mucho a clases y aun asi me va bien\"},{\"name\":\"for-3\",\"value\":\"amigos\"},{\"name\":\"for-4\",\"value\":\"responsable\r\nno procrastinar\r\ntrabajador\r\npaciente\"}]'),
(3, 1, 16121045, '[{\"name\":\"for-1\",\"value\":\"liderazgo, organizador, observador\"},{\"name\":\"for-2\",\"value\":\"no lo se, no me han dicho nunca eso \"},{\"name\":\"for-3\",\"value\":\"mi familia\"},{\"name\":\"for-4\",\"value\":\"liderazgo, fortaleza, ingenio, responsabilidad\"}]'),
