(3, 2, 16121289, '[{\"name\":\"opo-1\",\"value\":\"Nuevas amistades.\r\n\"},{\"name\":\"opo-2\",\"value\":\"Conseguir el empledo que deseo.\"},{\"name\":\"opo-3\",\"value\":\"Mudarme lejos.\"},{\"name\":\"opo-4\",\"value\":\"Nuevas amistades\r\nGraduarme\r\nConseguir empleo\r\nMudarme\"}]'),
(3, 2, 16121292, '[{\"name\":\"opo-1\",\"value\":\"Una gran oportunidad, es poder destar en lo relacionado a mi carrera, conocer mas personas que en algun momento podran ser de gran ayuada en lo laboral, poder tomar todas y cada una de las oportunidades que vengan y siempre optar por la mejor opcion.\"},{\"name\":\"opo-2\",\"value\":\"lo que mas me entusiasma seria poder desempeñarme con todo lo aprendido, y dar a conocer lo que aprendo,.\"},{\"name\":\"opo-3\",\"value\":\"Si no tuviera miedo, creceria lo mas que se pueda, no habria limites para alcanzar lo que quiero y mas, uno solo se forja sus limites sus asintotas, las cuales podrian no estar si no tevueramos miedo a crecer mas de lo que dicen que podemos, por eso creearia una empresa propia de mi carrera, y asi mas personas sabrian lo que son las tics, y implementarian mas en ellas.\"},{\"name\":\"opo-4\",\"value\":\"buena perspectiva laboral, \r\ncreativa empresarial\r\ncrecer como perona\r\nindependencia laboral\r\n\"}]'),
(3, 2, 16121295, '[{\"name\":\"opo-1\",\"value\":\"Nuevas amistades, una pareja sentimental, eventos sociales.\"},{\"name\":\"opo-2\",\"value\":\"Terminar una carrera y una pareja sentimental\"},{\"name\":\"opo-3\",\"value\":\"Tendria un mejor promedio y aprovecharia más oportunidades de estudio\"},{\"name\":\"opo-4\",\"value\":\"Tener una pareja sentimental\r\nTerminar una carrera\r\nTener nuevas grandes amistades\r\nConocer lugares nuevos\"}]'),
(3, 2, 16121300, '[{\"name\":\"opo-1\",\"value\":\"Nuevas amistades con diferentes mentalidades\r\nNuevos retos educativos\r\n\"},{\"name\":\"opo-2\",\"value\":\"conocer a nueva gente\"},{\"name\":\"opo-3\",\"value\":\"Estudiaría Japones \"},{\"name\":\"opo-4\",\"value\":\"ser mas sociable\r\nestudiar japones\r\nsaber hablar con los demás\r\n\"}]'),
(3, 2, 16121301, '[{\"name\":\"opo-1\",\"value\":\"Experiencias nuevas, oportunidades de trabajo, oportunidades de recreatividad, oportunidades de saber como conseguir lo que quiero, oportunidades de conocimiento.\"},{\"name\":\"opo-2\",\"value\":\"Trabajo y Experiencias\"},{\"name\":\"opo-3\",\"value\":\"Irme a otro país\"},{\"name\":\"opo-4\",\"value\":\"Trabajo, Experiencias, Conocimiento y de conseguir lo que quiero\"}]'),
(3, 2, 16121302, '[{\"name\":\"opo-1\",\"value\":\"Una oportunidad  que se me presento fue el recibir una beca para segur estudiando.\"},{\"name\":\"opo-2\",\"value\":\"Terminar el semestre sin problemas.\r\nReunirme con mi familia y ver a mis amigos\"},{\"name\":\"opo-3\",\"value\":\"No tengo ningún miedo\"},{\"name\":\"opo-4\",\"value\":\"*Estudiar al maimo.\r\n*Ver mas seguido a las personas que no eh visto.\r\n*Encontrar nuevos amigos y tener la oportunidad de tener su ayuda\r\n\"}]'),
(3, 2, 16121304, '[{\"name\":\"opo-1\",\"value\":\"amistades\"},{\"name\":\"opo-2\",\"value\":\"nuevos aprendizajes respecto a mi carrera\"},{\"name\":\"opo-3\",\"value\":\"-\"},{\"name\":\"opo-4\",\"value\":\"-crecimiento\r\n-ingreso a grupos\r\n-mejor aprovechamiento\r\n-nuevos conocimientos\"}]'),
(3, 2, 16121306, '[{\"name\":\"opo-1\",\"value\":\"tengo la oprtunidad de estudiar otro idioma\r\ntengo la oportunidad de asistir a conferencias\r\ntengo la oportunidad de conocer gente nueva\"},{\"name\":\"opo-2\",\"value\":\"me entusiama mucho graduarme \"},{\"name\":\"opo-3\",\"value\":\"haria completamente todo lo que me proponga\"},{\"name\":\"opo-4\",\"value\":\"conocer gente nueva\r\nestudiar lenguas\r\nasistir a conferencias\r\ngraduarme\"}]');
INSERT INTO `respuestas` (`idAnexo`, `subAnexo`, `idAlumno`, `respuestas`) VALUES
(3, 2, 16121308, '[{\"name\":\"opo-1\",\"value\":\"Nuevas amistades\r\nNuevos proyectos escolares\r\nTal vez en un futuro, otra presentacion cantando\"},{\"name\":\"opo-2\",\"value\":\"Tener nuevos proyectos\r\nTener mas exitos\r\nMas presentaciones musicales\"},{\"name\":\"opo-3\",\"value\":\"Me animaria a ir a mas comcursos de canto\"},{\"name\":\"opo-4\",\"value\":\"Oportunidad de nuevos amigos\r\nOportunidad de nuevos retos\r\nOportunidad de nuevos proyectos escolares\r\nOportunidad de nuevas presentaciones\"}]'),
(3, 2, 16121317, '[{\"name\":\"opo-1\",\"value\":\"Realmente el único suceso o la única oportunidad que veo que se me esta presentando es que tengo que abrir paso a los nuevos saberes en mi entorno escolar y ser lo mas responsable posible.\"},{\"name\":\"opo-2\",\"value\":\"No fracasar. Siempre tengo la actitud de esforzarme lo mejor posible y evitar el fracaso a toda costa.\"},{\"name\":\"opo-3\",\"value\":\"Realmente no le temo al futuro, lo espero con ansias.\"},{\"name\":\"opo-4\",\"value\":\"Evitar el fracaso\r\nSeguir con mis estudios\r\nTener felicidad\r\nSer una persona excelente\"}]'),
(3, 2, 16121570, '[{\"name\":\"opo-1\",\"value\":\"Generar mi proyecto para mi empresa\r\nAprender a cocinar\"},{\"name\":\"opo-2\",\"value\":\"Tener mi propia empresa\"},{\"name\":\"opo-3\",\"value\":\"Viajaría a muchos lugares del mundo\"},{\"name\":\"opo-4\",\"value\":\"Aprender a cocinar\r\nTener mi propia empresa\r\nViajar\r\nTener una estabilidad emocional y económica\"}]'),
(3, 2, 16121572, '[{\"name\":\"opo-1\",\"value\":\"La nueva oportundad que estoy teniendo con mi pareja actual y la posible relacion que puedo hacer con los nuevos compañeros de clases.\r\nTengo la oportunidad de seguir estudiando.\"},{\"name\":\"opo-2\",\"value\":\"La posibilidad de seguir con la pareja que estoy y formar un futuro.\r\nTerminar mi licenciatura teniendo 2 idiomas dominados.\r\nViajas y conocer personas que admiro.\"},{\"name\":\"opo-3\",\"value\":\"Viajar\"},{\"name\":\"opo-4\",\"value\":\"Viajar\r\nDominacion de 2 idiomas\r\nLicenciatura terminada\r\nVida con mi pareja \"}]'),
(3, 2, 16121573, '[{\"name\":\"opo-1\",\"value\":\"LA OPORTUNIDAD D CRECER EN MI TRABAJO Y EN MI FORMACIÓN ACADÉMICA.\"},{\"name\":\"opo-2\",\"value\":\"LUGARES A LOS QUE PUEDO LLEGAR AL REDEDOR DEL MUNDO\"},{\"name\":\"opo-3\",\"value\":\"ARRIESGARME A CONSEGUIR DIFERENTES OPORTUNIDADES\"},{\"name\":\"opo-4\",\"value\":\"TRABAJO, ÉXITO, AMISTADES Y RELACIONES PERSONALES\"}]'),
(3, 2, 16121574, '[{\"name\":\"opo-1\",\"value\":\"Puedo relacionarme con un número más grande de personas en este lugar \"},{\"name\":\"opo-2\",\"value\":\"El trabajar en algo que realmente me apasione y cumplir mis sueños, viajar y conocer nuevas cosas \"},{\"name\":\"opo-3\",\"value\":\"Arriesgarme a invertir en un negocio \"},{\"name\":\"opo-4\",\"value\":\"Viajar \r\nConocer nuevas personas \r\nArriesgarme \r\nInvertir\"}]'),
(3, 2, 16121575, '[{\"name\":\"opo-1\",\"value\":\"Estoy comenzando una nueva etapa en cuanto a lo academico, con ello nuevas amistades y retos que debo vencer.\"},{\"name\":\"opo-2\",\"value\":\"el étixo, que pueda triunfar en todos los momentos que se presenten.\"},{\"name\":\"opo-3\",\"value\":\"No preocuparme del fracaso realizaria todas mis actividades con la meor actitud, viajaria y dejaria una marca con mi actitud.\"},{\"name\":\"opo-4\",\"value\":\"Terminar mi carrera\r\nApoyo familiar\r\nNuevas experiencias de vida\r\nIndependencia \"}]'),
(3, 2, 16121579, '[{\"name\":\"opo-1\",\"value\":\"Aprender idiomas\"},{\"name\":\"opo-2\",\"value\":\"Conocer más personas del medio\"},{\"name\":\"opo-3\",\"value\":\"Viajar \r\nRomper limites\"},{\"name\":\"opo-4\",\"value\":\"Aprender idiomas\r\nConocer más personas del medio\r\nViajar \r\nRomper limites\"}]'),
(3, 2, 16121580, '[{\"name\":\"opo-1\",\"value\":\"Muchas nuevas amistades y formas de pensar \r\nPoder entrar algún programa de emprendedores del tec \"},{\"name\":\"opo-2\",\"value\":\"ser independiente \"},{\"name\":\"opo-3\",\"value\":\"Poner una empresa \"},{\"name\":\"opo-4\",\"value\":\"Nuevas formas de pensar\r\nImpulso\r\nDesarrollarme en cierto ámbito social \r\nVer más allá que otras personas \"}]'),
(3, 2, 16121581, '[{\"name\":\"opo-1\",\"value\":\"regresar con mi mamá\"},{\"name\":\"opo-2\",\"value\":\"ninguna, solo quiero acbar la carrera\"},{\"name\":\"opo-3\",\"value\":\"cursara otra carrera\"},{\"name\":\"opo-4\",\"value\":\"regresar con mi mama \r\nmorir\r\nterminar la carrera \r\nseguir entrenando \"}]'),
(3, 2, 16121583, '[{\"name\":\"opo-1\",\"value\":\"ASISTIR A PARTIDOS DE VOLLEY, MUCHAS NUEVAS AMISTADES, OPORTUNIDAD DE VIAJAR Y PRESENTACIONES DE TANGO\"},{\"name\":\"opo-2\",\"value\":\"EL PODER VIAJAR, TENER UNA CASA PROPIA, UN TRABAJO AL QUE DISFRUTE IR, UNA FAMILIA Y VIVIR EN OTRO PAÍS\"},{\"name\":\"opo-3\",\"value\":\"HARÍA TODO LO QUE EH ESCRITO EN UNA LISTA DE METAS A MEDIANO Y LARGO PLAZO\"},{\"name\":\"opo-4\",\"value\":\"DE VIAJAR,  DE TITULARME, SER UNA BUENA PROFESIONISTA \"}]'),
(3, 2, 16121585, '[{\"name\":\"opo-1\",\"value\":\"cambiar mi personalidad\r\nreforzar mis responsabilidades \r\nhacer amigos\"},{\"name\":\"opo-2\",\"value\":\"tener una vida mejor para ayudar a mis padres, tener un buen trabajo para algun dia tener una buena casa, un buen carro y posterior mente una familia\"},{\"name\":\"opo-3\",\"value\":\"basicamente lo que yo quisiera.\"},{\"name\":\"opo-4\",\"value\":\"trascender como persona\r\ncambiar mi personalidad\r\nlograr algo importante en mi vida\r\nhacer amigos\"}]'),
(3, 2, 16121587, '[{\"name\":\"opo-1\",\"value\":\"La oportunidad de pertenecer a un grupo de baile\r\nElegir un horario cómodo en la escuela\"},{\"name\":\"opo-2\",\"value\":\"Ser parte de un grupo de baile\r\n\"},{\"name\":\"opo-3\",\"value\":\"Destacar en todo lo que soy buena y actuar como realmente soy sin importar lo que digan los demás\"},{\"name\":\"opo-4\",\"value\":\"Desarrollarme en el mundo del baile\r\nSer un buen estudiante y destacado\r\n\"}]'),
(3, 2, 16121590, '[{\"name\":\"opo-1\",\"value\":\"Tengo nuevos amigos y nueva relación.\r\nHacer mi cambio de carrera.\r\nObtener una beca.\r\n\"},{\"name\":\"opo-2\",\"value\":\"Lograr estar en la carrera de Licenciatura en Contaduría y terminarla.\r\n\"},{\"name\":\"opo-3\",\"value\":\"Darme la oportunidad de tener una pareja y dejarme llevar, sin analizar tanto las cosas por miedo a que me lastimen de nuevo y demostrar mi lado débil.\"},{\"name\":\"opo-4\",\"value\":\"Tener nuevos amigos.\r\nTener una nueva pareja.\r\nObtener una beca\r\nRealizarme en la carrera de Licenciatura en Contaduría\"}]'),
(3, 2, 16121592, '[{\"name\":\"opo-1\",\"value\":\"Se me han presentado muy buenas amistades, sinceras y que me apoyan en aspectos escolares y personales, también las conferencias a las que asistimos por parte del aniversario de la carrera de administración fueron excelentes oportunidades de aprender, y así como la oportunidad de poder ir a clases de natación.\"},{\"name\":\"opo-2\",\"value\":\"Me entusiasma poder crecer profesionalmente, aprender muchas cosas y llegar a ser licenciada en administración, poder trabajar y ser independiente y poder ya con el tiempo vivir con mi novio. También tener mi propia asociación de cuidado animal y aprender idiomas como alemán y francés.\"},{\"name\":\"opo-3\",\"value\":\"Aprovecharía cada oportunidad que se presentase sin importar el grado de dificultad y con mucha confianza en mi misma.\"},{\"name\":\"opo-4\",\"value\":\"Terminar mi carrera, conseguir un buen empleo, vivir con mi novio, aprender otros idiomas.\"}]'),
(3, 2, 16121593, '[{\"name\":\"opo-1\",\"value\":\"Ser mas cuidadoso en mi salud \r\nNuevas amistades \r\nMejorar la relación con mi pareja\r\nEncontrar un trabajo\r\n\"},{\"name\":\"opo-2\",\"value\":\"Seguir estudiando \"},{\"name\":\"opo-3\",\"value\":\"Estudiar y trabajar al mismo tiempo \"},{\"name\":\"opo-4\",\"value\":\"Seguir estudiando \r\nnuevas amistades\r\nencontrar un trabajo \r\ncuidar mi salud \"}]'),
(3, 2, 16121595, '[{\"name\":\"opo-1\",\"value\":\"Poder pasar con buenas calificaciones a mi 2do semestre, la posibilidad de conocer gente nueva.\"},{\"name\":\"opo-2\",\"value\":\"La gente que estará conmigo, si conoceré gente nueva o no.\"},{\"name\":\"opo-3\",\"value\":\"Ser un poco más atrevida \"},{\"name\":\"opo-4\",\"value\":\"Ser una buena profesionista\r\nNuevas amistades\r\nUn poco más de atrevimiento de todos los apesctos\r\nNuevos rumbos\r\n\"}]'),
(3, 2, 16121598, '[{\"name\":\"opo-1\",\"value\":\"RELACIONARSE CON PERSONAS MENOS ESPERADAS, AMIGAS NUEVAS CON MUCHAS SIMILITUDES A MI\"},{\"name\":\"opo-2\",\"value\":\"VIVIR SOLA\"},{\"name\":\"opo-3\",\"value\":\"SALIRME DE MI CASA\"},{\"name\":\"opo-4\",\"value\":\"TRABAJO, VIVIR SOLA, UNA RELACIÓN, POSIBILIDAD DE UNA ESPECILIDAD\"}]'),
(3, 2, 16121606, '[{\"name\":\"opo-1\",\"value\":\"Aprender a manejar un grupo mediante asesorías\r\nMejorar mi forma de relacionarme con las personas\"},{\"name\":\"opo-2\",\"value\":\"Estar en la mañana\r\nAprender a tocar la batería\r\nTener mi banda de Rock\"},{\"name\":\"opo-3\",\"value\":\"Me iría al extranjero a estudiar algún idioma\"},{\"name\":\"opo-4\",\"value\":\"-Viajar al extranjero\r\n-Tener mi banda de Rock\r\n-Crecer como persona\r\n-Ser mas feliz\"}]'),
(3, 2, 16121607, '[{\"name\":\"opo-1\",\"value\":\"apoyo de familiares y amigos para poder continuar con mis estudios\"},{\"name\":\"opo-2\",\"value\":\"seguir estudiando, para poder al fin titularme y tener un buen empleo\"},{\"name\":\"opo-3\",\"value\":\"trabajaría y estudiaría al mismo tiempo,  \"},{\"name\":\"opo-4\",\"value\":\"seguir estudiando\r\ntrabajar y estudiar\r\nconocer a nuevas personas\r\nrealizar nuevos proyectos\"}]'),
(3, 2, 16121608, '[{\"name\":\"opo-1\",\"value\":\"Nuevas oportunidades para conocer personas \"},{\"name\":\"opo-2\",\"value\":\"Trabajar en una empresa internacional \r\nTener un gran circulo social\"},{\"name\":\"opo-3\",\"value\":\"No tengo miedo\"},{\"name\":\"opo-4\",\"value\":\"trabajar en una empresa grande\r\nconocer nuevas amistades\"}]'),
(3, 2, 16121611, '[{\"name\":\"opo-1\",\"value\":\"Poder subir mi promedio y tener nuevos amigos\"},{\"name\":\"opo-2\",\"value\":\"Poder trabajar\"},{\"name\":\"opo-3\",\"value\":\"Estudiar en otra ciudad\"},{\"name\":\"opo-4\",\"value\":\"Trabajar, estudiar, amistades, exito\"}]'),
(3, 2, 16121615, '[{\"name\":\"opo-1\",\"value\":\"Diversas oportunidades laborales y profesionales.\r\nRelaciones con muchas nuevas personas que pueden aportar cosas constructivas a mi vida.\"},{\"name\":\"opo-2\",\"value\":\"La oportunidad de trabajar haciendo lo que me gusta y por lo que he luchado. Descubrir nuevas cosas de mi disfrutar de estar realizando todos los proyectos que tengo planeados.\"},{\"name\":\"opo-3\",\"value\":\"Desarrollar mi máximo potencial, probar cosas nuevas y hasta cierto punto arriesgadas.\r\n(Ya no tengo tanto miedo como antes).\"},{\"name\":\"opo-4\",\"value\":\"1.-Trabajar en proyectos en base a mi preparación académica con personas importantes.\r\n2.-Iniciar a la par con Administración la carrera que está en mis planes.\r\n3.- Iniciar algunos proyectos que tengo.\r\n4.- Alcanzar mayor independencia.\"}]'),
(3, 2, 16121616, '[{\"name\":\"opo-1\",\"value\":\"La oportunidad de prepararme correctamente para la vida laboral.\"},{\"name\":\"opo-2\",\"value\":\"Tener la posibilidad de terminar mi licenciatura y conseguir un trabajo que me apasione.\"},{\"name\":\"opo-3\",\"value\":\"Seria una persona mas expresiva y con mas iniciativa y seguridad.\"},{\"name\":\"opo-4\",\"value\":\"Un buen trabajo \r\nUna oportunidad para aprender a relacionarme con los demás.\r\nTener mas conocimientos y aprender a ser mas dedicado.\"}]'),
(3, 2, 16121617, '[{\"name\":\"opo-1\",\"value\":\"Aprender ingles al 100%\r\nAprender a tocar un instrumento\r\nTomar un curso de costura\"},{\"name\":\"opo-2\",\"value\":\"Aprender cosas nuevas\"},{\"name\":\"opo-3\",\"value\":\"Muchas cosas, seria cantante, hablaría sobre cualquier tema frente a muchas personas.\"},{\"name\":\"opo-4\",\"value\":\"Aprender Ingles\r\nAprender cosas nuevas\r\nViajar a Estados Unidos para perfeccionar el ingles\r\nTocar algún instrumento\"}]'),
(3, 2, 16121620, '[{\"name\":\"opo-1\",\"value\":\"conocer nuevas personas \r\ndesarrollarme mejor con las personas que ya conozco \"},{\"name\":\"opo-2\",\"value\":\"tener mas experiencia \r\nconseguir mis metas\"},{\"name\":\"opo-3\",\"value\":\"tomaría cualquier oportunidad que tuviera para conocer y adquirir mas experiencia tanto personal como algo que me ayude para mi carrera \"},{\"name\":\"opo-4\",\"value\":\"conocer personas \r\ntrabajar \r\ntener experiencias\r\ndesarrollarme\"}]'),
(3, 2, 16121622, '[{\"name\":\"opo-1\",\"value\":\"1. la oportunidad de conocer mas personas\r\n2. adquirir conocimientos nuevos\r\n3. ser mas comprometido con la carrera\r\n4. ser optimista\r\n5. tener visión de lider\"},{\"name\":\"opo-2\",\"value\":\"*empezar una nueva etapa en mi vida\r\n*relacionarme con mas personas\r\n*creer como persona\r\n\"},{\"name\":\"opo-3\",\"value\":\"*expandir mis horizontes aun más\r\n*cultivarme mas como persona\r\n*viajar mas y salir de la zona de confort\r\n\"},{\"name\":\"opo-4\",\"value\":\"1. conocer mas gente\r\n2. adquirir mayor conocimiento\r\n3. ser mejor persona\r\n4. empezar de cero\"}]'),
(3, 2, 16121623, '[{\"name\":\"opo-1\",\"value\":\"cursar mi carrera\r\naprnder ingles\"},{\"name\":\"opo-2\",\"value\":\"conseguir un trabajo\r\nayudar a persnas\"},{\"name\":\"opo-3\",\"value\":\"no tengo miedo\"},{\"name\":\"opo-4\",\"value\":\"conseguir un trabajo\r\ncasarme\r\nemprender un proyecto\"}]'),
(3, 2, 16121628, '[{\"name\":\"opo-1\",\"value\":\"conocer gente que le gusta la carrera que a mi me gusta, ver los proyectos que puedo desarrollar con las personas que saben lo que quieren.\r\nasistir a conferencias y congresos que tenga a universidad.\r\ncrear amistades que son muy valiosas\"},{\"name\":\"opo-2\",\"value\":\"podre dedicarme a lo que mas me gusta, y aprender de todo lo que se me vaya presentando.\r\nmas que nada me gustan los negocios, y por eso mismo negociare lo mejor que pueda comprometiendome.\"},{\"name\":\"opo-3\",\"value\":\"No tengo miedo.\"},{\"name\":\"opo-4\",\"value\":\"mejorar como persona.\r\ntener nuevas amistades.\r\nasistir a conferencias.\r\naprender mas de la escuela.\"}]'),
(3, 2, 16121629, '[{\"name\":\"opo-1\",\"value\":\"Nuevas mitades,  el estudiar\"},{\"name\":\"opo-2\",\"value\":\"El viajar y conseguir el trabajo que yo quiero \"},{\"name\":\"opo-3\",\"value\":\"Emprender un viaje\"},{\"name\":\"opo-4\",\"value\":\"Viajar\r\nTrabajar\r\nAprender\r\nConocer\"}]'),
(3, 2, 16121635, '[{\"name\":\"opo-1\",\"value\":\"tener más amistades, un trabajo.\"},{\"name\":\"opo-2\",\"value\":\"poder trabajar, poder concluir mis estudios, hacer una maestría\"},{\"name\":\"opo-3\",\"value\":\"todo lo que no me permite hacer el miedo. Como ser más expresiva\"},{\"name\":\"opo-4\",\"value\":\"Terminar mi carrera\r\nObtener un buen promedio\r\nEncontrar trabajo\r\nHacer una mestría\"}]'),
(3, 2, 17120676, '[{\"name\":\"opo-1\",\"value\":\"entrar al tecnologico\"},{\"name\":\"opo-2\",\"value\":\"tener una casa, un buen trabajo y casarme \"},{\"name\":\"opo-3\",\"value\":\"trabajar y viajar\"},{\"name\":\"opo-4\",\"value\":\"trabajo, amistades, estudios y caracter\"}]'),
(3, 3, 11120315, '[{\"name\":\"deb-1\",\"value\":\"pena\r\nfalta de conocimientos\"},{\"name\":\"deb-2\",\"value\":\"controlar el temperamento\"},{\"name\":\"deb-3\",\"value\":\"dejar de beber\"},{\"name\":\"deb-4\",\"value\":\"todas\"}]'),
(3, 3, 13120451, '[{\"name\":\"deb-1\",\"value\":\"a\"},{\"name\":\"deb-2\",\"value\":\"a\"},{\"name\":\"deb-3\",\"value\":\"a\"},{\"name\":\"deb-4\",\"value\":\"a\"}]'),
(3, 3, 14120577, '[{\"name\":\"deb-1\",\"value\":\"Mi desesperación y mis impulsos\"},{\"name\":\"deb-2\",\"value\":\"El no reconocer aveces \"},{\"name\":\"deb-3\",\"value\":\"Mi forma de ser en particular lo impulsivo\"},{\"name\":\"deb-4\",\"value\":\"impulsivo, aveces no reconozco, \"}]'),
(3, 3, 16121001, '[{\"name\":\"deb-1\",\"value\":\"no soy muy responsable y soy flojo\"},{\"name\":\"deb-2\",\"value\":\"sufrimiento no creo pero no soy responsable\"},{\"name\":\"deb-3\",\"value\":\"quisiera ser mas responsable\"},{\"name\":\"deb-4\",\"value\":\"no creo que ninguna pronto\"}]'),
(3, 3, 16121002, '[{\"name\":\"deb-1\",\"value\":\"La desidia\"},{\"name\":\"deb-2\",\"value\":\"Sinceridad excesiva\"},{\"name\":\"deb-3\",\"value\":\"Mi (en ocasiones) bajo autoestima\"},{\"name\":\"deb-4\",\"value\":\"Desidia, poca motivación, baja autoestima, escasa vida social\"}]'),
