(3, 3, 16121011, '[{\"name\":\"deb-1\",\"value\":\"falta de conocimientos, momentos de baja autoestima y malas decisiones tomadas\"},{\"name\":\"deb-2\",\"value\":\"ira, estrés y problemas familiares y/o personales\"},{\"name\":\"deb-3\",\"value\":\"ser más analítico en la toma de decisiones para llegar a las mejores soluciones y un cambio en mi caracter\"},{\"name\":\"deb-4\",\"value\":\"problemas familiares, falta de conocimientos, inseguridad y mal caracter\"}]'),
