(3, 3, 16121018, '[{\"name\":\"deb-1\",\"value\":\"Mi mayor debilidad siempre ha sido la comodidad, cuando estoy cómodo no aprendo, debo estar en constante flujo y actividad para hacer que valga la pena todo.\"},{\"name\":\"deb-2\",\"value\":\"En primera lo mismo que el anterior, la flojera y en segundo sentir que ya lo se todo, pues no es así quedan millones de cosas más por aprender y perfeccionar.\"},{\"name\":\"deb-3\",\"value\":\"Me gustaría ser más activo\"},{\"name\":\"deb-4\",\"value\":\"Flojera\r\nPensar que lo sé todo\r\nNo aprovechar oportunidades\r\nPoner el tiempo como un pretexto\"}]'),
