(3, 3, 16121025, '[{\"name\":\"deb-1\",\"value\":\"No aprovecho totalmente mi tiempo. Un poco desordenado. Autoexigente\"},{\"name\":\"deb-2\",\"value\":\"A veces soy muy impulsivo. Expreso mi forma de pensar a veces sin importarme el impacto que pueda ausar a los demás. \"},{\"name\":\"deb-3\",\"value\":\"Ser mas organizado. \"},{\"name\":\"deb-4\",\"value\":\"Impulsivo. Desorganizado. Confiado. Autoexigente\"}]'),
