(3, 3, 16121292, '[{\"name\":\"deb-1\",\"value\":\"lo que creeo que esta mas relacionado, es un poco de desconcentracion, lo momentos en los que llegas a sentirte triste o deprimido y nada te parece bien mas que dejar todo y no pensar en nada mas y hacerte desobligado,.\"},{\"name\":\"deb-2\",\"value\":\"El echo de sentirse mal con uno mismo, ya involucra causarse sufrimiento uno mismo y a las personas que te rodean por tu mal caracter o tristeza en si mismo. \"},{\"name\":\"deb-3\",\"value\":\"Ser un poco menos cuestionativa, ya que siempre suelo cuestionar todo, y a las demas personas por el echo de desir te quiero, cuestiono que sera ese queres, quisiera dejar de pensar demaciado cuestionando lo que siempre es verdad.\"},{\"name\":\"deb-4\",\"value\":\"La cuestionabilidad, \r\nel egoismo\r\nla antipatia \r\ny la flojera\"}]'),
