(3, 3, 16121302, '[{\"name\":\"deb-1\",\"value\":\"El unico fracaso que considero importante fue el hecho de no entrar  a la universidad el año pasado pero no me redi y lo intente de nuevo\"},{\"name\":\"deb-2\",\"value\":\"*Por el momento ninguna\"},{\"name\":\"deb-3\",\"value\":\"*Me gustaria ser mas segura de mi misma osea cambiar mi inseguridad por lo que puedo lograr\"},{\"name\":\"deb-4\",\"value\":\"*Inseguridad.\r\n*Miedo a fracasar\r\n*Que las personas no me den su apoyo\"}]'),
(3, 3, 16121304, '[{\"name\":\"deb-1\",\"value\":\"me dejo llevar muy rapido sin antes ver lo bueno o malo que me pueda pasar\"},{\"name\":\"deb-2\",\"value\":\"pensar mejor las cosas antes de decir o actuar\"},{\"name\":\"deb-3\",\"value\":\"ser mas reservada en el sentido de no dejarme llevar rapidamente por la primera impresion \"},{\"name\":\"deb-4\",\"value\":\"-voluntad\r\n-impaciente\r\n-ansiedad\r\n-obstinado\r\n\"}]'),
