(3, 3, 16121317, '[{\"name\":\"deb-1\",\"value\":\"Al ser una persona amable y solidaria, a veces las personas abusan de eso y me \"arrinconan\", en esos momentos no se que es lo mejor que debería hacer o si debería solo alejarme, pero si me alejo y sus problemas son serios, no habrá nadie que les ayude.\"},{\"name\":\"deb-2\",\"value\":\"Los problemas emocionales. Últimamente he notado que las personas se ven muy afectadas por los estados emocionales, lo cual a la larga, los empieza a deteriorar física y mentalmente por, el \"dolor\" que les causa.\"},{\"name\":\"deb-3\",\"value\":\"Me gustaría ser un poco mas \"frío\", es decir, no dejarme llevar por las emociones propias ni ajenas.\"},{\"name\":\"deb-4\",\"value\":\"Emocional\r\n\"}]'),
(3, 3, 16121570, '[{\"name\":\"deb-1\",\"value\":\"No saber inglés ni ningún otro idioma\"},{\"name\":\"deb-2\",\"value\":\"Desidia por hacer las cosas\r\nTener miedo a lo desconocido \"},{\"name\":\"deb-3\",\"value\":\"No tener miedo a hacer lo que realmente quiero\"},{\"name\":\"deb-4\",\"value\":\"Miedo\r\nDesidia\r\nTimidez\r\nNo saber otro idioma\"}]'),
