(3, 3, 16121575, '[{\"name\":\"deb-1\",\"value\":\"Estres\r\nCaracter\r\nImpaciencia\r\nPienso mucho las cosas a futuro  y no me arriesgo en ocasiones\r\nDesordenada\r\n\"},{\"name\":\"deb-2\",\"value\":\"Soy muy explosiva con mi carácter, en ocasiones no puedo medirme ni controlarme, mi carácter es muy fuerte en cuanto a enojo.\"},{\"name\":\"deb-3\",\"value\":\"Saber manejar mi carácter y saber decir las cosas que aunque soy muy directa saber como no lastimas a los demás.\"},{\"name\":\"deb-4\",\"value\":\"Explosiva de caracter.\r\nEstresada\r\ndesordenada \r\nPienso mucho las cosas antes de hacerlas\r\n\"}]'),
