(3, 3, 16121585, '[{\"name\":\"deb-1\",\"value\":\"mi inseguridad, mi timidez, mi asocialidad, el miedo a las burlas, el miedo a equivocarme, el miedo a ir mas aya.\"},{\"name\":\"deb-2\",\"value\":\"mi prepotencia aveces, el echo de hablar sin pensar, el excluirme de la gente.\"},{\"name\":\"deb-3\",\"value\":\"todos mis estupidos miedos, no tiene sentido tenerlos, pero no puedo evitar tenerlos\"},{\"name\":\"deb-4\",\"value\":\"timidez\r\ninseguridad\r\nconformismo (en ocaciones)\r\nfalta de interes (aveces)\"}]'),
