(3, 3, 16121590, '[{\"name\":\"deb-1\",\"value\":\"Mi autoestima\"},{\"name\":\"deb-2\",\"value\":\"Mi desconfianza\r\nMi forma de esconder mis sentimientos siendo indiferente y fría.\"},{\"name\":\"deb-3\",\"value\":\"La falta de amor propio y desconfianza que me tengo.\"},{\"name\":\"deb-4\",\"value\":\"Mi autoestima\r\nLa falta de amor propio \r\nLa desconfianza que me tengo y tengo hacia los demás\r\nMi forma de esconder mis sentimientos mostrándome indiferente y fría.\"}]'),
(3, 3, 16121592, '[{\"name\":\"deb-1\",\"value\":\"la deficiencia es que no me preparo, es decir, a veces no tomo en cuenta mis debilidades y al momento del problema no salgo bien porque me hizo falta reforzar ese aspecto\"},{\"name\":\"deb-2\",\"value\":\"Podría ser mi mal humor y mi estrés que es muy inconstante y suelo herir con mis comentarios, además que no me hace sentir bien conmigo misma no poder controlarlo\"},{\"name\":\"deb-3\",\"value\":\"Me gustaría poder cambiar mi actitud, ser más positiva y arriesgada sin que me de miedo a equivocarme\"},{\"name\":\"deb-4\",\"value\":\"Falta de preparación\r\nEstrés\r\nDesconfianza\r\nMiedo a fallar\"}]'),
(3, 3, 16121593, '[{\"name\":\"deb-1\",\"value\":\"Dejar las cosas para el último momento\r\nNo dar la suficiente importancia a las cosas\"},{\"name\":\"deb-2\",\"value\":\"No expresar mis sentimientos \r\nDarle mayor importancia a los demás que a mí \"},{\"name\":\"deb-3\",\"value\":\"Ser tan callado\"},{\"name\":\"deb-4\",\"value\":\"Dejar las cosas para el último momento\r\nNo dar la suficiente importancia a las cosas.\r\nNo expresar mis sentimientos\r\nDarle mayor importancia a las demás personas que a mí.\"}]'),
(3, 3, 16121595, '[{\"name\":\"deb-1\",\"value\":\"La desconfianza de mi misma\r\n\"},{\"name\":\"deb-2\",\"value\":\"Mi carácter\r\nSoy muy impaciente\r\nMe gusta que las cosas se hagan como yo quiero \"},{\"name\":\"deb-3\",\"value\":\"mi autoestima\"},{\"name\":\"deb-4\",\"value\":\"Mi baja autoestima\r\nMi carácter\r\nMi paciencia\r\nMi apertura con la gente\"}]'),
(3, 3, 16121598, '[{\"name\":\"deb-1\",\"value\":\"TEMOR Y SENTIMENTALISMO, SOY UNA PERSONA DEMASIADO SENTIMENTAL Y  A VECES NO HAGO COSAS POR MIEDO \"},{\"name\":\"deb-2\",\"value\":\"IMPULSIVA: A VECES HAGO LAS COSAS SIN PENSAR\"},{\"name\":\"deb-3\",\"value\":\"ME GUSTARÍA CAMBIAR  A SER MÁS REFLEXIVA\"},{\"name\":\"deb-4\",\"value\":\"TEMOR, INSEGURIDAD, SENSIBILIDAD\"}]'),
(3, 3, 16121606, '[{\"name\":\"deb-1\",\"value\":\"No saber exactamente lo que quiero\"},{\"name\":\"deb-2\",\"value\":\"Soy muy manipulabre y me sonsaco fácilmente \"},{\"name\":\"deb-3\",\"value\":\"Leer un poco más\"},{\"name\":\"deb-4\",\"value\":\"-No saber exactamente lo que quiero\r\n-Soy muy manipulabre y me sonsaco fácilmente \r\n-Leer un poco más\r\n-No darle el valor a los momentos \"}]'),
(3, 3, 16121607, '[{\"name\":\"deb-1\",\"value\":\"el miedo a lo desconocido y al fracaso.\"},{\"name\":\"deb-2\",\"value\":\"no considero que tenga tendencias que dañen a los demás puesto que una de las cosas que más cuido es no dañar a los demás con mis actos.\"},{\"name\":\"deb-3\",\"value\":\"a no esperar las cosas con tanto tiempo , tratar de ser más rápida en mi manera de actuar y no pensarlo mucho, puesto que de las equivocaciones también se aprende.\"},{\"name\":\"deb-4\",\"value\":\"pensar las cosas mucho y no actuar rápido,\r\nel miedo a lo desconocido,\r\ntener poco conocimiento\r\nlimitaciones económicas.\r\n\"}]'),
(3, 3, 16121608, '[{\"name\":\"deb-1\",\"value\":\"La falta de tomar accion para alcanzar mis objetivos\"},{\"name\":\"deb-2\",\"value\":\"no tengo ninguna\"},{\"name\":\"deb-3\",\"value\":\"El hecho de ser mas social\"},{\"name\":\"deb-4\",\"value\":\"La falta de tomar accion para alcanzar mis objetivos\"}]'),
(3, 3, 16121611, '[{\"name\":\"deb-1\",\"value\":\"Miedo, timidez\"},{\"name\":\"deb-2\",\"value\":\"Introversion\"},{\"name\":\"deb-3\",\"value\":\"La flojera\"},{\"name\":\"deb-4\",\"value\":\"Flojera, miedo, introversion, timidez\"}]'),
(3, 3, 16121615, '[{\"name\":\"deb-1\",\"value\":\"Mi nivel de exigencias.\"},{\"name\":\"deb-2\",\"value\":\"Mi temperamento.\"},{\"name\":\"deb-3\",\"value\":\"Sólo mejorar y seguir aprendiendo.\r\nY trabajar los apegos.\"},{\"name\":\"deb-4\",\"value\":\"1.-Mi nivel de exigencias para conmigo misma y con los demás.\r\n2.- Mi temperamento fuerte.\r\n3.-Se me dificulta disfrutar de las cosas en un 100% Dejarme fluir.\r\n4.-Algunos apegos.\"}]'),
(3, 3, 16121616, '[{\"name\":\"deb-1\",\"value\":\"Mi debilidad mas común es que aveces no le doy mucha importancia a las cosas y fallo al momento de realizarlas.\"},{\"name\":\"deb-2\",\"value\":\"A veces suelo ser muy egoísta no me preocupo por los problemas de los demás solo por los míos, y eso causa que algunas personas me rechazen\"},{\"name\":\"deb-3\",\"value\":\"Me gustaría cambiar mi forma de estudiar y mi responsabilidad con mis trabajo y tareas.\"},{\"name\":\"deb-4\",\"value\":\"Egoísmo\r\nIrresponsabilidad\r\nActitud negativa\r\nFalta de compromiso\"}]'),
(3, 3, 16121617, '[{\"name\":\"deb-1\",\"value\":\"El miedo\"},{\"name\":\"deb-2\",\"value\":\"mi egoísmo, mi falta de confianza en mi misma, mi timidez \"},{\"name\":\"deb-3\",\"value\":\"Dejar de tener miedo, enfrentarme al mundo y hacer las cosas que siempre he querido\"},{\"name\":\"deb-4\",\"value\":\"Miedo\r\nEgoismo\r\nTimidez\r\nDesconfianza\"}]'),
(3, 3, 16121620, '[{\"name\":\"deb-1\",\"value\":\"me derribo fácilmente si algo no me sale bien y me cuesta seguir adelante \"},{\"name\":\"deb-2\",\"value\":\"desconfianza \r\nmiedo a probar nuevas cosas o experiencias \"},{\"name\":\"deb-3\",\"value\":\"tener mas confianza en mi misma \"},{\"name\":\"deb-4\",\"value\":\"miedo \r\ndesconfianza \r\ninseguridad \r\n\"}]'),
(3, 3, 16121622, '[{\"name\":\"deb-1\",\"value\":\"* miedo a hacer nuevas cosas\r\n*conformismo\r\n* ser de carácter debil\"},{\"name\":\"deb-2\",\"value\":\"* egoísmo: el a veces solo pensar en mi antes que en los demás.\r\n*conformismo: no conformarme con lo mínimo que haga \r\n\"},{\"name\":\"deb-3\",\"value\":\"*seguridad personal\r\n*ser mas responsable\r\n*ser mas generoso\"},{\"name\":\"deb-4\",\"value\":\"1.inseguridad\r\n2.irresponsabilidad\r\n3.conformismo\r\n4.cerrado de mente\"}]'),
(3, 3, 16121623, '[{\"name\":\"deb-1\",\"value\":\"pereza\r\ndesinteres\"},{\"name\":\"deb-2\",\"value\":\"desinteres\"},{\"name\":\"deb-3\",\"value\":\"la forma de hacer las cosas\"},{\"name\":\"deb-4\",\"value\":\"miedo\r\ndesinteres\r\npereza\"}]'),
(3, 3, 16121628, '[{\"name\":\"deb-1\",\"value\":\"no soy muy paciente.\r\nme pongo triste por unos dias hasta que siento que ya es suficiente.\"},{\"name\":\"deb-2\",\"value\":\"suelo ser muy directo y a veces no mido bien el daño de mis palabras.\"},{\"name\":\"deb-3\",\"value\":\"mi ego.\r\nmis palabras.\r\nmi tolerancia.\"},{\"name\":\"deb-4\",\"value\":\"mi ego.\r\nmis palabras dañinas.\r\nmi desesperacion.\r\n\"}]'),
