(3, 4, 16121016, '[{\"name\":\"ame-1\",\"value\":\"Superar de la mejor forma todo lo que viene en mi vida.\"},{\"name\":\"ame-2\",\"value\":\"Hacer lo que me concierne de la mejor manera.\"},{\"name\":\"ame-3\",\"value\":\"Hacer y prepararme para algunas cosas.\"},{\"name\":\"ame-4\",\"value\":\"A que ocurra alguna desgracia familiar.\"},{\"name\":\"ame-5\",\"value\":\"Costos elevados de la educación.\r\nEl deterioro de la salud.\r\nEconomía incierta.\r\nCosas y experiencias por venir muy complicadas. \"}]'),
(3, 4, 16121018, '[{\"name\":\"ame-1\",\"value\":\"Aun me da un poco de miedo el hecho de saber que será un largo camino obtener mi título universitario, sin embargo estoy dispuesto a enfrentar lo que sea para lograrlo\"},{\"name\":\"ame-2\",\"value\":\"Ninguno, realmente no hay nada que me impida hacer lo que me proponga\"},{\"name\":\"ame-3\",\"value\":\"Mi flojera de nuevo\"},{\"name\":\"ame-4\",\"value\":\"A la comodidad, a no seguir luchando y dandolo todo de mi\"},{\"name\":\"ame-5\",\"value\":\"Flojera\r\nTiempo medido\r\nComodidad\r\nConformidad\"}]'),
(3, 4, 16121023, '[{\"name\":\"ame-1\",\"value\":\"encontrar el lugar adecuado donde vivir\"},{\"name\":\"ame-2\",\"value\":\"saber que personas deben estar a mi lado\"},{\"name\":\"ame-3\",\"value\":\"malas influencias \"},{\"name\":\"ame-4\",\"value\":\"al cambio \r\na estar solo\"},{\"name\":\"ame-5\",\"value\":\"malas influencias\r\nnegatividad\r\nno tener proceso\r\nambiente pesado\"}]'),
(3, 4, 16121025, '[{\"name\":\"ame-1\",\"value\":\"Mucha competitividad en el campo laboral. Profesionistas mejor prepoarados que yo. \"},{\"name\":\"ame-2\",\"value\":\"Comenzar a incursionar en el campo laboral\"},{\"name\":\"ame-3\",\"value\":\"Enfrentarme a retos que puedan llegar a exigir más de mi, de mis capacidades y conocimientos.\"},{\"name\":\"ame-4\",\"value\":\"A recorrer solo todo mi camino de superación. Me gustaría que todos mis amigos y familiares estén ahi para verme y apoyarme a conseguir mis metas y sueños.\"},{\"name\":\"ame-5\",\"value\":\"Pocas fuentes de trabajo (en sector local). Emigrar a otro estado e incluso otro país para desarrollarme en el campo laboral. Competitividad laboral. Personal mejor capacitado que yo. \"}]'),
(3, 4, 16121026, '[{\"name\":\"ame-1\",\"value\":\"Lograr las cosas sin ninguna ayuda\"},{\"name\":\"ame-2\",\"value\":\"Tomar mis propias decisiones\"},{\"name\":\"ame-3\",\"value\":\"Ser independiente económicamente.\"},{\"name\":\"ame-4\",\"value\":\"A no cumplir mis sueños\"},{\"name\":\"ame-5\",\"value\":\"Cambio de ambiente social y aumento de exigencias por parte del sector laboral.\"}]');
