(3, 4, 16121029, '[{\"name\":\"ame-1\",\"value\":\"Seran todas las consecuencias que tome. \"},{\"name\":\"ame-2\",\"value\":\"Seguir en mi carrera\"},{\"name\":\"ame-3\",\"value\":\"tener miedo al momento de hacer algo\"},{\"name\":\"ame-4\",\"value\":\"Aa reprobar y a no ser nada\"},{\"name\":\"ame-5\",\"value\":\"Reprobar\r\nno tener amigos\r\nestar solo\r\nno tener proposito de vida\"}]'),
(3, 4, 16121036, '[{\"name\":\"ame-1\",\"value\":\"Al complicado futuro laboral en México, con contratos de poco tiempo, salarios bajos y abundancia de desempleados\"},{\"name\":\"ame-2\",\"value\":\"Salir enfrentar el mundo y recibir las cosas como son y no como yo quisiera\"},{\"name\":\"ame-3\",\"value\":\"La sociabilidad, siempre evito hablar con desconocidos, pero en un futuro tendré que superar eso si quiero salir a conseguir empleo\"},{\"name\":\"ame-4\",\"value\":\"Al fracaso, a que un día mire hacia el pasado y no este conforme, a pensar siempre que las cosas pudieron ser de otro modo\"},{\"name\":\"ame-5\",\"value\":\"El futuro laboral de México\r\nAl fracaso\r\nAl arrepentimiento\r\nAl ser incapaz de socializar\"}]'),
