(3, 4, 16121045, '[{\"name\":\"ame-1\",\"value\":\"la sociedad\"},{\"name\":\"ame-2\",\"value\":\"no lo se, yo vivo el presente\"},{\"name\":\"ame-3\",\"value\":\"Responsabilidad\"},{\"name\":\"ame-4\",\"value\":\"a que me hagan daño\"},{\"name\":\"ame-5\",\"value\":\"falta de dinero, de trabajo, de hogar, y familia\"}]'),
