(3, 5, 16121598, '[{\"name\":\"res-for\",\"value\":\"SOCIABILIDAD, ACTITUD POSITIVA\"},{\"name\":\"res-opo\",\"value\":\"NUEVAS RELACIONES, OPORTUNIDADES DE VIDA\"},{\"name\":\"res-deb\",\"value\":\"INSEGURIDAD, TEMOR, SENTIR INCAPACIDAD\"},{\"name\":\"res-ame\",\"value\":\"PENSAR EN LA INCAPACIDAD ENTES DE LA CAPACIDAD\"}]'),
(3, 5, 16121606, '[{\"name\":\"res-for\",\"value\":\"-Ser paciente\r\n-Ser solidario\"},{\"name\":\"res-opo\",\"value\":\"-Crecer como persona\r\n-Aprender de la vida\"},{\"name\":\"res-deb\",\"value\":\"-No leer mucho\r\n-Ser muy flojo\"},{\"name\":\"res-ame\",\"value\":\"-Las peleas con mamá\r\n-El fracaso\"}]'),
(3, 5, 16121607, '[{\"name\":\"res-for\",\"value\":\"una de las fortalezas es que me gusta convivir con los demás por lo tanto aprendo más de ellos, claro solo tomo lo que me va a ayudar y a servir para ser mejor persona, para ello necesito la paciencia y la tolerancia puesto que cada persona es diferente  y tiene un carácter que lo distingue de los demás,\"},{\"name\":\"res-opo\",\"value\":\"en este momento tengo el apoyo de mi familia y amigos que me ayudan para poder seguir con mis estudios para poder formarme mejor como persona y estar bien capacitada para enfrentar los nuevos retos que se van dando.\"},{\"name\":\"res-deb\",\"value\":\"una de mis debilidades es el miedo al fracaso y a lo desconocido, pero esto se quita al momento de empezar a realízalo y entender que aquello que se veía muy difícil de realizar no lo es.\"},{\"name\":\"res-ame\",\"value\":\"una de las amenazas que enfrentaría es aferrarme a las cosas o a las personas y por lo tanto no querer cambios, pero eso es momentáneo puesto que también la idea de conocer más cosas me entusiasma pero también me da un poco de miedo. \"}]'),
(3, 5, 16121608, '[{\"name\":\"res-for\",\"value\":\"Constancia \"},{\"name\":\"res-opo\",\"value\":\"Conocer nuevas personas\"},{\"name\":\"res-deb\",\"value\":\"no tomar accion para alcanzar mis objetivos\"},{\"name\":\"res-ame\",\"value\":\"el no encontrar el empleo que quiero\"}]'),
(3, 5, 16121611, '[{\"name\":\"res-for\",\"value\":\"Valentía Honestidad\"},{\"name\":\"res-opo\",\"value\":\"Estabilidad economica\"},{\"name\":\"res-deb\",\"value\":\"Timidez\"},{\"name\":\"res-ame\",\"value\":\"Flojera\"}]'),
(3, 5, 16121615, '[{\"name\":\"res-for\",\"value\":\"Responsabilidad, fuerza, fortaleza, madurez, inteligencia, empatía.\"},{\"name\":\"res-opo\",\"value\":\"Ofertas laborales y profesionales.\r\nY crecimiento personal.\"},{\"name\":\"res-deb\",\"value\":\"Mi nivel de exigencias.\r\nNo disfrutar del todo.\"},{\"name\":\"res-ame\",\"value\":\"Posibles consecuencias a las desiciones que tome y que puedan forzar algunas etapas de mi vida.\"}]');
INSERT INTO `respuestas` (`idAnexo`, `subAnexo`, `idAlumno`, `respuestas`) VALUES
(3, 5, 16121616, '[{\"name\":\"res-for\",\"value\":\"Soy una persona sencilla, honesta y bondadosa que respeta la opinión de las demás personas y soy dedicado a hacer las cosas que me gustan.\"},{\"name\":\"res-opo\",\"value\":\"Considero que soy una persona con muchas oportunidades de ser una persona mas preparada y no pienso desaprovechar mis oportunidades.\"},{\"name\":\"res-deb\",\"value\":\"Falta de compromiso y soy egoísta.\"},{\"name\":\"res-ame\",\"value\":\"Si no me esfuerzo lo suficiente no voy a lograr cumplir mis metas y aspiraciones en la vida.\"}]'),
(3, 5, 16121617, '[{\"name\":\"res-for\",\"value\":\"Inteligencia\r\nCreatividad \r\nPuntualidad\r\nDedicación\"},{\"name\":\"res-opo\",\"value\":\"Aprender Ingles\r\nTocar un instrumento\r\nViajar\r\nAprender cosas nuevas\"},{\"name\":\"res-deb\",\"value\":\"Miedo\r\nTimidez\r\nFalta de confianza \r\nEgoismo\"},{\"name\":\"res-ame\",\"value\":\"La gente\r\nMis miedos\r\nNo creer en mi\r\nContexto actual\"}]'),
(3, 5, 16121620, '[{\"name\":\"res-for\",\"value\":\"perseverante \r\nleal\"},{\"name\":\"res-opo\",\"value\":\"oportunidades para desarrollarme como persona en para mi futuro profesional \"},{\"name\":\"res-deb\",\"value\":\"miedo al fracaso \"},{\"name\":\"res-ame\",\"value\":\"estar sola \"}]'),
(3, 5, 16121622, '[{\"name\":\"res-for\",\"value\":\"ser positivo aun que no sea lo mas indicado y abrir nuevos horizontes de la mano de las nuevas personas que pudiera conocer\"},{\"name\":\"res-opo\",\"value\":\"nueva etapa para empezar de cero las cosas que me hubiera gustado hacer en nla etapa ya finalizada\"},{\"name\":\"res-deb\",\"value\":\"miedo a lo aun desconocido y de cierto modo a lo que se vendrá en el futuro\"},{\"name\":\"res-ame\",\"value\":\"las malas amistades que a veces pueden ser tu primer paso para fracasar en tus planes \"}]'),
(3, 5, 16121623, '[{\"name\":\"res-for\",\"value\":\"forma de ser y pensar\r\n\"},{\"name\":\"res-opo\",\"value\":\"crecer personalmente y profecionalmente\"},{\"name\":\"res-deb\",\"value\":\"indiferencia y la pereza\"},{\"name\":\"res-ame\",\"value\":\"toma de decisiones apresuradas\"}]'),
(3, 5, 16121628, '[{\"name\":\"res-for\",\"value\":\"positivo.\r\nmotivador.\r\nfacilidad para aprender.\r\n\"},{\"name\":\"res-opo\",\"value\":\"conocer gente nueva.\r\ncrear amistades duraderas.\r\nasistir a nuevos congresos y conferencias.\r\naprender nuevos conocimientos aparte de los relacionados con mi carrera.\"},{\"name\":\"res-deb\",\"value\":\"mi egocentrismo.\r\nmi no desesperacion\r\nmi enojo.\r\nmis malas palabras.\"},{\"name\":\"res-ame\",\"value\":\"afectaciones economicas.\r\n\"}]'),
(3, 5, 16121629, '[{\"name\":\"res-for\",\"value\":\"Buena actitud y paciencia \"},{\"name\":\"res-opo\",\"value\":\"Viajar\r\nConseguir trabajo deseado\"},{\"name\":\"res-deb\",\"value\":\"Timides e inseguridad \"},{\"name\":\"res-ame\",\"value\":\"No conseguir trabajo \"}]'),
(3, 5, 16121635, '[{\"name\":\"res-for\",\"value\":\"Responsabilidad, respetuosa, solidaria, adaptable\"},{\"name\":\"res-opo\",\"value\":\"tener una maestría \r\nun trabajo digno\r\ncrecer como persona\"},{\"name\":\"res-deb\",\"value\":\"inseguridad\r\nmiedo\r\nestrés\r\ntristeza\r\n\"},{\"name\":\"res-ame\",\"value\":\"al fracaso, o no cumplir mis metas\"}]'),
(3, 5, 17120676, '[{\"name\":\"res-for\",\"value\":\"inteligencia\r\ncapacidad\r\nvoluntad\r\nactitud\"},{\"name\":\"res-opo\",\"value\":\"estudiar\r\ntrabajar\r\n\"},{\"name\":\"res-deb\",\"value\":\"miedo\r\nestres\r\nindiferencia\"},{\"name\":\"res-ame\",\"value\":\"fracaso\r\nestar sola\r\nno poder \r\n\"}]'),
